gital.com.au\njaneleeshian@gmail.com','test3','','publish','closed','closed','','test3','','','2020-08-05 05:38:52','2020-08-05 05:38:52','',0,'https://alphaomegadigital.com.au/?post_type=flamingo_inbound&p=7661',0,'flamingo_inbound','',0),(7771,1,'2020-09-07 22:09:51','2020-09-07 22:09:51','','favicon files','','inherit','open','closed','','favicon-files','','','2020-09-07 22:09:51','2020-09-07 22:09:51','',0,'https://alphaomegadigital.com.au/wp-content/uploads/2020/09/favicon-files.zip',0,'attachment','application/zip',0),(7772,1,'2020-09-07 22:10:25','2020-09-07 22:10:25','','favicon-32x32','','inherit','open','closed','','favicon-32x32','','','2020-09-07 22:10:41','2020-09-07 22:10:41','',0,'https://alphaomegadigital.com.au/wp-content/uploads/2020/09/favicon-32x32-1.png',0,'attachment','image/png',0),(7773,1,'2020-09-07 22:11:15','2020-09-07 22:11:15','','apple-touch-icon','','inherit','open','closed','','apple-touch-icon','','','2020-09-07 22:11:29','2020-09-07 22:11:29','',0,'https://alphaomegadigital.com.au/wp-content/uploads/2020/09/apple-touch-icon.png',0,'attachment','image/png',0),(7774,1,'2020-09-07 22:11:35','2020-09-07 22:11:35','https://alphaomegadigital.com.au/wp-content/uploads/2020/09/cropped-apple-touch-icon.png','cropped-apple-touch-icon.png','','inherit','open','closed','','cropped-apple-touch-icon-png','','','2020-09-07 22:11:35','2020-09-07 22:11:35','',0,'https://alphaomegadigital.com.au/wp-content/uploads/2020/09/cropped-apple-touch-icon.png',0,'attachment','image/png',0),(7984,1,'2020-10-14 04:18:53','2020-10-14 04:18:53','<!-- wp:image {\"align\":\"center\",\"id\":8198,\"sizeSlug\":\"large\"} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-large\"><img src=\"https://alphaomegadigital.com.au/wp-content/uploads/2020/08/400x150.png\" alt=\"Genesis Framework\" class=\"wp-image-8198\"/></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:group -->\n<div class=\"wp-block-group\"><div class=\"wp-block-group__inner-container\"><!-- wp:heading {\"fontSize\":\"large\"} -->\n<h2 class=\"has-large-font-size\"><br>One of the things I love about Genesis framework is the use of widget areas. </h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Widget areas allow the user to easily change content within different areas of their website, with a plethora of options from built in and third party plugins. If your client is wanting a wordpress site setup that they or their marketing person will easily be able to manage themselves, then using widget areas only for their content is the best way to do it, in my opinion. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>A client project I have been working on for <a href=\"http://alphadevsite.co\">Megan Jordan Celebrant</a> required an additional widget area. Unknowingly, she describe the area correctly when she said \"I\'d like an instagram feed to appear before the footer.\"  </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>I laughed and said \"Sure, you need a before footer widget area.\"</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Here\'s how I did it:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":1} -->\n<h1>Step 1. </h1>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>First, I\'m going to check the <a href=\"https://genesistutorials.com/visual-hook-guide/\">Genesis Visual Hook</a> guide to find the correct action hook to place my widget. I\'ve mapped it on the page and I am going to use the action hook genesis_before_footer which will ensure any content placed within the widget will appear right before the page footer. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":7986,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><a href=\"https://genesistutorials.com/visual-hook-guide/\"><img src=\"https://alphaomegadigital.com.au/wp-content/uploads/2020/10/before-footer-hook.png\" alt=\"\" class=\"wp-image-7986\"/></a><figcaption>genesis_before_footer</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:heading {\"level\":1} -->\n<h1>Step 2. </h1>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Next we need to declare the widget area in our child themes functions.php file. Now I\'ve used naming conventions that are specific to my client, but you can replace the id\'s, names and description to match your project. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Here\'s the code: </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":7985,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://alphaomegadigital.com.au/wp-content/uploads/2020/10/Declare-widget-area.png\" alt=\"\" class=\"wp-image-7985\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:heading {\"level\":1} -->\n<h1>Step 3. </h1>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Next, we need to position the widget to the before footer widget area. This is the part where we add the action hook genesis_before_footer, that \"hooks in\" the widget area to the before footer location. </p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:group -->\n\n<!-- wp:image {\"id\":7987,\"width\":699,\"height\":192,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"https://alphaomegadigital.com.au/wp-content/uploads/2020/10/position-widget-area.png\" alt=\"genesis before footer\" class=\"wp-image-7987\" width=\"699\" height=\"192\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":1} -->\n<h1>Step 4. </h1>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Now we have added the above code to our functions.php file, If you log into the front end and click on the widgets area, the widget and description are displayed as so: </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":7988,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://alphaomegadigital.com.au/wp-content/uploads/2020/10/extra-footer-widget-for-instagram-feed.png\" alt=\"add footer widget area\" class=\"wp-image-7988\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":1} -->\n<h1>Step 5. </h1>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Now, when I add the widget to my before_footer_widget_area, I have selected <a href=\"https://spotlightwp.com/\">Spotlight Instagram Feed</a> which is an awesome plugin that connects to your client\'s instagram page to show the latest posts. It\'s follow buttons are load more buttons are customisable with CSS, included in the free version. You can see the result below. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":7989,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://alphaomegadigital.com.au/wp-content/uploads/2020/10/instafeed-1024x578.png\" alt=\"add instagram feed to footer area\" class=\"wp-image-7989\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>And that\'s it! If you found this article helpful, or have questions please contact me, tweet me or comment. </h3>\n<!-- /wp:heading -->','Add an extra widget to before footer widget area on Genesis Framework','','publish','open','open','','add-an-extra-widget-to-before-footer-widget-area-on-genesis-framework','','','2020-11-06 00:56:27','2020-11-06 00:56:27','',0,'https://alphaomegadigital.com.au/?p=7984',0,'post','',2),(7768,1,'2020-11-04 04:59:44','2020-11-04 04:59:44','Jane\nJames\nalphaomegadigitalau@gmail.com\nJane James','alphaomegadigitalau@gmail.com','','publish','closed','closed','','alphaomegadigitalau-gmail-com','','','2020-11-04 04:59:44','2020-11-04 04:59:44','',0,'https://alphaomegadigital.com.au/?post_type=flamingo_contact&#038;p=7768',0,'flamingo_contact','',0),(7677,1,'2020-09-28 04:20:08','2020-09-28 04:20:08','<!-- wp:image {\"id\":8191,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://alphaomegadigital.com.au/wp-content/uploads/2020/09/banyule-business.png\" alt=\"Banyule business\" class=\"wp-image-8191\"/><figcaption>Banyule Business grants scheme</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Applications have just closed for the third round of the Banyule business grants scheme. Most businesses in Banyule by now would\'ve applied for the $5000 business grant. There was also a $2500 grant for business coaching services, that was a seperate financial pool to the main business grant scheme. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>This grant is specifically for local businesses impacted by covid who want to bring their products/service online and open up their potential customer base to other areas. For most businesses, that is going to mean building a site with an E-Commerce function, or a digital marketing campaign- most likely ad words, and targeted social media advertising to promote their existing online store.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Round 3 <a href=\"https://banyulebusiness.com.au/covid19grants/\">closed</a> 22/9/2020, however Banyule has announced they\'re doing two further rounds at the start of 2021 - In February and March. 20% of the key selection criteria is local procurement- that is you get 20% of your mark awarded for finding a local provider for your services, within the Banyule area. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Of the round2 Banyule Business grants 30/61 applicants were awarded the $5000 grant to help their business develop and build revenue online, which is a pretty great strike rate if you ask me. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>I can attest as someone who applied for round 3 that the process, and application is about half a day\'s work, tops. The application officer is lovely, and they even provide a group Zoom meeting to advise applicants how to successfully write a grant- they\'re made it a no brainer for busy business owners, who lack experience in grant writing and council applications. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Will you be applying for round 4 and 5? What have you got to lose?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Alpha Omega Digital is offering premium <a href=\"https://alphaomegadigital.com.au/web-development/\">web design</a>, <a href=\"https://alphaomegadigital.com.au/content-marketing/\">content</a> and <a href=\"https://alphaomegadigital.com.au/digitalmarketing/\">digital marketing</a> services in Banyule and I am more than happy to provide you a PDF quote on email if you\'d like to get in <a href=\"https://alphaomegadigital.com.au/contact-2/\">touch</a>. </p>\n<!-- /wp:paragraph -->','Applying for the Banyule Business grants scheme?','','publish','open','open','','applying-for-the-banyule-business-grants-scheme','','','2020-11-04 05:13:08','2020-11-04 05:13:08','',0,'http://alphaomegadigital.com.au/?p=7677',0,'post','',0),(1059,1,'2018-07-24 12:15:04','2018-07-24 12:15:04','\n				\n								','006','\n				\n								','publish','closed','closed','','006','','','2018-07-24 12:15:04','2018-07-24 12:15:04','',0,'https://alphaomegadigital.com.au/?post_type=client&amp;p=1059',0,'client','',0),(1061,1,'2018-07-24 12:16:16','2018-07-24 12:16:16','\n				\n								','007','\n				\n								','publish','closed','closed','','007','','','2018-07-24 12:16:16','2018-07-24 12:16:16','',0,'https://alphaomegadigital.com.au/?post_type=client&amp;p=1061',0,'client','',0),(1063,1,'2018-07-24 12:22:26','2018-07-24 12:22:26','\n				\n								','008','\n				\n								','publish','closed','closed','','008','','','2018-07-24 12:22:26','2018-07-24 12:22:26','',0,'https://alphaomegadigital.com.au/?post_type=client&amp;p=1063',0,'client','',0),(1112,1,'2018-07-25 10:08:17','2018-07-25 10:08:17','\n				\n								','Demos','\n				\n								','publish','closed','closed','','demos','','','2018-07-25 10:08:17