017/07/studio-1.jpg\",\"id\":7294,\"hasParallax\":true,\"dimRatio\":93,\"minHeight\":800,\"gradient\":\"vivid-cyan-blue-to-vivid-purple\",\"align\":\"full\",\"className\":\"eplus-vKu94p\"} -->\n<div class=\"wp-block-cover alignfull has-background-dim-90 has-background-dim has-parallax has-background-gradient eplus-vKu94p\" style=\"background-image:url(https://alphaomegadigital.com.au/wp-content/uploads/2017/07/studio-1.jpg);min-height:800px\"><span aria-hidden=\"true\" class=\"wp-block-cover__gradient-background has-vivid-cyan-blue-to-vivid-purple-gradient-background\"></span><div class=\"wp-block-cover__inner-container\"><!-- wp:paragraph {\"align\":\"left\",\"placeholder\":\"Write title…\",\"className\":\"fade-in-up in viewport eplus-BvaxW7\",\"style\":{\"typography\":{\"fontSize\":58}}} -->\n<p class=\"has-text-align-left fade-in-up in viewport eplus-BvaxW7\" id=\"h1-hero\" style=\"font-size:58px\"><strong>Web Development</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns {\"align\":\"full\",\"className\":\"eplus-dvWM5D\"} -->\n<div class=\"wp-block-columns alignfull eplus-dvWM5D\"><!-- wp:column {\"className\":\"eplus-gPQdt3\"} -->\n<div class=\"wp-block-column eplus-gPQdt3\"><!-- wp:paragraph {\"className\":\"fade-in-up in viewport eplus-2ge0ev\",\"textColor\":\"white\"} -->\n<p class=\"fade-in-up in viewport eplus-2ge0ev has-white-color has-text-color\">The type of service I offer is typically a WordPress website that is built on the Genesis Framework. I use Genesis for my own sites, and mostly for client sites as well. Genesis delivers a high quality wordpress website that is SEO friendly and optimised for speed. Your site should ideally load in under 3 seconds and use a minimal amount of plugins in order to achieve this, and this is a marker I aim for when delivering a new web project. You can read more about why I use Genesis for my projects <strong><a href=\"https://alphaomegadigital.com.au/why-i-use-the-genesis-framework\">here</a>.</strong></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"width\":28.8,\"className\":\"eplus-XRmIW6\"} -->\n<div class=\"wp-block-column eplus-XRmIW6\" style=\"flex-basis:28.8%\"></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div></div>\n<!-- /wp:cover -->\n\n<!-- wp:genesis-blocks/gb-container {\"containerPaddingTop\":20,\"containerPaddingRight\":10,\"containerPaddingBottom\":0,\"containerPaddingLeft\":10,\"containerMarginBottom\":0,\"containerBackgroundColor\":\"#ffffff\",\"containerDimRatio\":10,\"align\":\"full\",\"className\":\"section-2\"} -->\n<div style=\"background-color:#ffffff;padding-left:10%;padding-right:10%;padding-top:20%\" class=\"wp-block-genesis-blocks-gb-container alignfull section-2 gb-block-container\"><div class=\"gb-container-inside\"><div class=\"gb-container-content\"><!-- wp:genesis-blocks/gb-container {\"containerPaddingBottom\":1.5,\"className\":\"c2\"} -->\n<div style=\"padding-bottom:1.5%\" class=\"wp-block-genesis-blocks-gb-container c2 gb-block-container\"><div class=\"gb-container-inside\"><div class=\"gb-container-content\"><!-- wp:columns {\"className\":\"eplus-gdflZ1\"} -->\n<div class=\"wp-block-columns eplus-gdflZ1\"><!-- wp:column {\"className\":\"eplus-8UzPhJ\"} -->\n<div class=\"wp-block-column eplus-8UzPhJ\"><!-- wp:genesis-blocks/gb-container {\"containerPaddingTop\":5,\"containerPaddingRight\":7,\"containerPaddingBottom\":5,\"containerPaddingLeft\":7,\"containerMarginBottom\":0,\"containerBackgroundColor\":\"#000000\",\"className\":\"c2-child\"} -->\n<div style=\"background-color:#000000;padding-left:7%;padding-right:7%;padding-bottom:5%;padding-top:5%\" class=\"wp-block-genesis-blocks-gb-container c2-child gb-block-container\"><div class=\"gb-container-inside\"><div class=\"gb-container-content\"><!-- wp:genesis-blocks/gb-container {\"containerPaddingTop\":5,\"containerPaddingRight\":3,\"containerPaddingBottom\":5,\"containerPaddingLeft\":3,\"containerMarginBottom\":0,\"containerBackgroundColor\":\"#0