"className\":\"eplus-v2bQKP\"} -->\n<div class=\"wp-block-column eplus-v2bQKP\"><!-- wp:genesis-blocks/gb-container {\"containerPaddingTop\":5,\"containerPaddingRight\":7,\"containerPaddingBottom\":5,\"containerPaddingLeft\":7,\"containerMarginBottom\":0,\"containerBackgroundColor\":\"#2b2663\",\"className\":\"c2-child\"} -->\n<div style=\"background-color:#2b2663;padding-left:7%;padding-right:7%;padding-bottom:5%;padding-top:5%\" class=\"wp-block-genesis-blocks-gb-container c2-child gb-block-container\"><div class=\"gb-container-inside\"><div class=\"gb-container-content\"><!-- wp:genesis-blocks/gb-container {\"containerPaddingTop\":5,\"containerPaddingRight\":3,\"containerPaddingBottom\":5,\"containerPaddingLeft\":3,\"containerMarginBottom\":0,\"containerBackgroundColor\":\"#443d94\",\"className\":\"c2-child-content\"} -->\n<div style=\"background-color:#443d94;padding-left:3%;padding-right:3%;padding-bottom:5%;padding-top:5%\" class=\"wp-block-genesis-blocks-gb-container c2-child-content gb-block-container\"><div class=\"gb-container-inside\"><div class=\"gb-container-content\"><!-- wp:image {\"align\":\"center\",\"id\":8402,\"width\":60,\"height\":60,\"sizeSlug\":\"large\"} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-large is-resized\"><img src=\"https://alphaomegadigital.com.au/wp-content/uploads/2020/11/writing.svg\" alt=\"writing-white-svg\" class=\"wp-image-8402\" width=\"60\" height=\"60\"/></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:heading {\"align\":\"center\",\"className\":\"eplus-dYwNcD\",\"style\":{\"color\":{\"text\":\"#ffffff\"},\"typography\":{\"fontSize\":17}}} -->\n<h2 class=\"has-text-align-center eplus-dYwNcD has-text-color\" style=\"font-size:17px;color:#ffffff\">Content Marketing</h2>\n<!-- /wp:heading -->\n\n<!-- wp:genesis-blocks/gb-button {\"buttonText\":\"learn more\",\"buttonAlignment\":\"center\",\"buttonSize\":\"gb-button-size-small\",\"buttonShape\":\"gb-button-shape-circular\"} -->\n<div style=\"text-align:center\" class=\"wp-block-genesis-blocks-gb-button gb-block-button\"><a href=\"https://alphaomegadigital.com.au/content-marketing-2/\" class=\"gb-button gb-button-shape-circular gb-button-size-small\" style=\"color:#ffffff;background-color:#3373dc\">learn more</a></div>\n<!-- /wp:genesis-blocks/gb-button --></div></div></div>\n<!-- /wp:genesis-blocks/gb-container --></div></div></div>\n<!-- /wp:genesis-blocks/gb-container --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div></div></div>\n<!-- /wp:genesis-blocks/gb-container --></div></div></div>\n<!-- /wp:genesis-blocks/gb-container -->\n\n<!-- wp:genesis-blocks/gb-container {\"containerPaddingTop\":0,\"containerPaddingRight\":0,\"containerPaddingBottom\":0,\"containerPaddingLeft\":0,\"containerMarginTop\":0,\"containerMarginBottom\":0,\"containerBackgroundColor\":\"#443d94\",\"containerDimRatio\":10,\"align\":\"full\"} -->\n<div style=\"background-color:#443d94\" class=\"wp-block-genesis-blocks-gb-container alignfull gb-block-container\"><div class=\"gb-container-inside\"><div class=\"gb-container-content\"><!-- wp:genesis-blocks/gb-container {\"containerPaddingTop\":5,\"containerPaddingRight\":10,\"containerPaddingBottom\":10,\"containerPaddingLeft\":10} -->\n<div style=\"padding-left:10%;padding-right:10%;padding-bottom:10%;padding-top:5%\" class=\"wp-block-genesis-blocks-gb-container gb-block-container\"><div class=\"gb-container-inside\"><div class=\"gb-container-content\"><!-- wp:heading {\"level\":1,\"className\":\"eplus-lYGRZY edplus_anim-SH79Is\",\"textColor\":\"white\",\"style\":{\"typography\":{\"fontSize\":70}}} -->\n<h1 class=\"eplus-lYGRZY edplus_anim-SH79Is has-white-color has-text-color\" style=\"font-size:70px\">The process</h1>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"className\":\"eplus-j6u9kJ edplus_anim-sG08BE\",\"textColor\":\"white\",\"style\":{\"typography\":{\"fontSize\":30}}} -->\n<h2 class=\"eplus-j6u9kJ edplus_anim-sG08BE has-white-color has-text-color\" style=\"font-size:30px\">Client Brief.</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"className\":\"eplus-L0uSie\"} -->\n<p class=\"eplus-L0uSie\"></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"eplus-Eih67u edplus_anim-vh41WR\",\"textColor\":\"white\"} -->\n<p class=\"eplus-Eih67u edplus_anim-vh41WR has-white-color has-text-color\">The very first step is meeting up online or in person, and having a discussion around your current website, the pitfalls, and what you are looking to gain out of your new web project. This is a detailed conversation that is imperative so together we can achieve business as well as design objectives.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":1,\"className\":\"eplus-YCqLxp edplus_anim-Z2sxCF\",\"textColor\":\"white\",\"style\":{\"typography\":{\"fontSize\":30}}} -->\n<h1 class=\"eplus-YCqLxp edplus_anim-Z2sxCF has-white-color has-text-color\" style=\"font-size:30px\">Design. </h1>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"className\":\"eplus-AKeSF4 edplus_anim-xvDrqz\",\"textColor\":\"white\"} -->\n<p class=\"eplus-AKeSF4 edplus_anim-xvDrqz has-white-color has-text-color\">After uncovering your needs at our first meeting, I will request any asset files you have and wish to use and begin working on a site mockup for you.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"eplus-KE3t7g edplus_anim-uWzWLY\",\"textColor\":\"white\"} -->\n<p class=\"eplus-KE3t7g edplus_anim-uWzWLY has-white-color has-text-color\">For&nbsp;<strong>bigger</strong>&nbsp;projects, you will get a design system in&nbsp;<a href=\"https://www.figma.com/\">Figma.</a>&nbsp;Usually we’d start with a home page mockup, and if you are happy with the layout, I will then create additional pages for your site as well as as the responsive version. Your site will then be built using my Genesis starter theme. Yes it is still a child theme for Genesis, but there are no inherited styles or content, its a bare bones starter theme that merely has functions and a basic codebase to work off.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"eplus-ZlZ5Pf edplus_anim-eBtvda\",\"textColor\":\"white\"} -->\n<p class=\"eplus-ZlZ5Pf edplus_anim-eBtvda has-white-color has-text-color\">For clients with a&nbsp;<strong>limited budget,</strong>&nbsp;I will create a one page style guide and you will receive a link to a staging domain where I will edit your existing Genesis child theme to match the styles and colours of the chosen child theme. There may be some modifications to your functions.php file, and perhaps some custom functions or custom post types but your site will not be highly modified. This is because you can basically modify a child theme to within an inch of its life, and heavy modifications of an existing child theme require just as much work as building a site from a starter theme. And the budget allocated to the project reflects the amount of work required.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":1,\"className\":\"eplus-XLk7Gh edplus_anim-oB3Ash\",\"textColor\":\"white\",\"style\":{\"typography\":{\"fontSize\":30}}} -->\n<h1 class=\"eplus-XLk7Gh edplus_anim-oB3Ash has-white-color has-text-color\" style=\"font-size:30px\">Development.</h1>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"className\":\"eplus-MQvcbS edplus_anim-a9XF3S\",\"textColor\":\"white\"} -->\n<p class=\"eplus-MQvcbS edplus_anim-a9XF3S has-white-color has-text-color\">This is the phase where your design and your style guide will be converted into code. You will be sent a development link and your site is deployed to a staging domain. This will allow you to see how your site is coming to fruition, and allows for a collaborative process between us to make sure you are completely happy with the look and feel of your site, and also add in any business functions you may wish to have such as Paypal integration, Mailchimp integration, Zapier, Zen desk and so on. Your site will also be continuously backed up with version control on Github, so if changes are made and you wish to revert to a previous version of the site the option is there to do so. You will be asked to provide the content- that is the pages and what is written to explain your service offering. If you aren’t comfortable doing this, or don’t have time I can do it for you for an additional charge.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"className\":\"eplus-WBdsTr edplus_anim-BTxTeX\",\"textColor\":\"white\",\"style\":{\"typography\":{\"fontSize\":30}}} -->\n<h2 class=\"eplus-WBdsTr edplus_anim-BTxTeX has-white-color has-text-color\" style=\"font-size:30px\">Deploy. </h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"className\":\"eplus-yKYMga edplus_anim-rlMgex\",\"textColor\":\"white\"} -->\n<p class=\"eplus-yKYMga edplus_anim-rlMgex has-white-color has-text-color\">After you have approved your site and content on the staging domain, I will deploy your site to your domain using FTP client and your C Panel. I personally use and recommend&nbsp;<strong><a href=\"https://ventraip.com.au/\">Ventra IP</a>&nbsp;</strong>for secure and fast wordpress hosting, and if you arrange the hosting through us I will be able to login to your C panel in future if you require backups or updates. If you don’t wish to do this, you can purchase your own hosting plan and give me access for the deployment process.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":1,\"className\":\"eplus-M3L3y7 edplus_anim-BC0Bwj\",\"textColor\":\"white\",\"style\":{\"typography\":{\"fontSize\":30}}} -->\n<h1 class=\"eplus-M3L3y7 edplus_anim-BC0Bwj has-white-color has-text-color\" style=\"font-size:30px\">Marketing.</h1>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"className\":\"eplus-R5iSYq edplus_anim-aQLBPT\",\"textColor\":\"white\"} -->\n<p class=\"eplus-R5iSYq edplus_anim-aQLBPT has-white-color has-text-color\">A misconception that commonly occurs amongst clients is that once their website is up and running, their phone will ring off the hook and this couldn’t be more untrue. However: if you do nothing to market your business online via social media, <a href=\"http://ads.google.com\" data-type=\"URL\" data-id=\"ads.google.com\">google ads</a>, social media advertising, content marketing and so on you are not doing anything to actively promote your business.  If you want to be successful online, and within a short time period as opposed to a slow burn over ten years, you should expect to spend 5-10 times more on marketing than you did for your web project. Marketing is never going to be one single thing, but a combination of content marketing, social media, paid search, paid advertising and networking. If you can do all of these things successfully you will see good results over time. For clients who do not have much budget to spend on marketing but do have the time to spend doing it, I highly recommend you implement the marketing plan provided at the end of your web project. </p>\n<!-- /wp:paragraph --></div></div></div>\n<!-- /wp:genesis-blocks/gb-container -->\n\n<!-- wp:paragraph {\"className\":\"eplus-W0lMXv\"} -->\n<p class=\"eplus-W0lMXv\"> </p>\n<!-- /wp:paragraph --></div></div></div>\n<!-- /wp:genesis-blocks/gb-container -->\n\n<!-- wp:paragraph {\"className\":\"eplus-Gx0RWX\"} -->\n<p class=\"eplus-Gx0RWX\"></p>\n<!-- /wp:paragraph -->','Web-development','','inherit','closed','closed','','9103-revision-v1','','','2020-11-25 03:14:17','2020-11-25 03:14:17','',9103,'https://alphaomegadigital.com.au/9103-revision-v1/',0,'revision','',0),(1366,1,'2018-07-30 06:49:06','2018-07-30 06:49:06','\n				\n								','CRM Scalability Mobile','\n				\n								','publish','closed','closed','','crm-scalability-mobile','','','2018-07-30 06:49:06','2018-07-30 06:49:06','',0,'https://alphaomegadigital.com.au/?p=1366',1,'nav_menu_item','',0),(1367,1,'2018-07-30 06:49:06','2018-07-30 06:49:06','\n				\n								','Disrupt Taste Makers','\n				\n								','publish','closed','closed','','disrupt-taste-mak