<p class=\"has-text-align-left fade-in-up in viewport eplus-BvaxW7\" id=\"h1-hero\" style=\"font-size:58px\"><strong>Content Marketing</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns {\"align\":\"full\",\"className\":\"eplus-dvWM5D\"} -->\n<div class=\"wp-block-columns alignfull eplus-dvWM5D\"><!-- wp:column {\"className\":\"eplus-gPQdt3\"} -->\n<div class=\"wp-block-column eplus-gPQdt3\"><!-- wp:paragraph {\"className\":\"fade-in-up in viewport eplus-2ge0ev\",\"textColor\":\"white\"} -->\n<p class=\"fade-in-up in viewport eplus-2ge0ev has-white-color has-text-color\">Content is Queen. Well executed content is the greatest SEO strategy you will ever employ, and outranks any back end SEO endeavours you have tried before. One of the best things you can do for yourself long term is to have a content marketing strategy that is researched, planned and scheduled over the course of a year. Quality content gives you a higher ranking in google, and it\'s the driving force behind why visitors visit your website. Content builds authority, and is yet another form of social proof that represents your business as a trustworthy company that your clients want to buy from. </p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"width\":28.8,\"className\":\"eplus-XRmIW6\"} -->\n<div class=\"wp-block-column eplus-XRmIW6\" style=\"flex-basis:28.8%\"></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div></div>\n<!-- /wp:cover -->\n\n<!-- wp:genesis-blocks/gb-container {\"containerPaddingTop\":20,\"containerPaddingRight\":10,\"containerPaddingBottom\":0,\"containerPaddingLeft\":10,\"containerMarginBottom\":0,\"containerBackgroundColor\":\"#ffffff\",\"containerDimRatio\":10,\"align\":\"full\",\"className\":\"section-2\"} -->\n<div style=\"background-color:#ffffff;padding-left:10%;padding-right:10%;padding-top:20%\" class=\"wp-block-genesis-blocks-gb-container alignfull section-2 gb-block-container\"><div class=\"gb-container-inside\"><div class=\"gb-container-content\"><!-- wp:genesis-blocks/gb-container {\"containerPaddingBottom\":1.5,\"className\":\"c2\"} -->\n<div style=\"padding-bottom:1.5%\" class=\"wp-block-genesis-blocks-gb-container c2 gb-block-container\"><div class=\"gb-container-inside\"><div class=\"gb-container-content\"><!-- wp:block {\"ref\":9194} /--></div></div></div>\n<!-- /wp:genesis-blocks/gb-container --></div></div></div>\n<!-- /wp:genesis-blocks/gb-container -->\n\n<!-- wp:genesis-blocks/gb-container {\"containerPaddingTop\":0,\"containerPaddingRight\":0,\"containerPaddingBottom\":0,\"containerPaddingLeft\":0,\"containerMarginTop\":0,\"containerMarginBottom\":0,\"containerBackgroundColor\":\"#443d94\",\"containerDimRatio\":10,\"align\":\"full\"} -->\n<div style=\"background-color:#443d94\" class=\"wp-block-genesis-blocks-gb-container alignfull gb-block-container\"><div class=\"gb-container-inside\"><div class=\"gb-container-content\"><!-- wp:genesis-blocks/gb-container {\"containerPaddingTop\":5,\"containerPaddingRight\":10,\"containerPaddingBottom\":10,\"containerPaddingLeft\":10} -->\n<div style=\"padding-left:10%;padding-right:10%;padding-bottom:10%;padding-top:5%\" class=\"wp-block-genesis-blocks-gb-container gb-block-container\"><div class=\"gb-container-inside\"><div class=\"gb-container-content\"><!-- wp:heading {\"level\":1,\"className\":\"eplus-lYGRZY edplus_anim-SH79Is\",\"textColor\":\"white\",\"style\":{\"typography\":{\"fontSize\":70}}} -->\n<h1 class=\"eplus-lYGRZY edplus_anim-SH79Is has-white-color has-text-color\" style=\"font-size:70px\">The process</h1>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"className\":\"eplus-j6u9kJ edplus_anim-sG08BE\",\"textColor\":\"white\",\"style\":{\"typography\":{\"fontSize\":30}}} -->\n<h2 class=\"eplus-j6u9kJ edplus_anim-sG08BE has-white-color has-text-color\" style=\"font-size:30px\">Content Review</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"className\":\"eplus-L0uSie\"} -->\n<p class=\"eplus-L0uSie\"></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"eplus-Eih67u edplus_anim-vh41WR\",\"textColor\":\"white\"} -->\n<p class=\"eplus-Eih67u edplus_anim-vh41WR has-white-color has-text-color\">First we\'ll review your current content strategy (if you have one) and discuss how successful it has been for you so far. If you have never dabbled with content marketing before, we will discuss what content is most appropriate for your business and what resources, physical and financial are required to achieve your goals. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":1,\"className\":\"eplus-YCqLxp edplus_anim-Z2sxCF\",\"textColor\":\"white\",\"style\":{\"typography\":{\"fontSize\":30}}} -->\n<h1 class=\"eplus-YCqLxp edplus_anim-Z2sxCF has-white-color has-text-color\" style=\"font-size:30px\">Research.  </h1>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"className\":\"eplus-AKeSF4 edplus_anim-xvDrqz\",\"textColor\":\"white\"} -->\n<p class=\"eplus-AKeSF4 edplus_anim-xvDrqz has-white-color has-text-color\">At this stage I will conduct some content research to see what topics are sought after in your industry. I may check resources such as <a rel=\"noreferrer noopener\" href=\"http://feedly.com\" data-type=\"URL\" data-id=\"feedly.com\" target=\"_blank\">feedly</a> to see whats trending on social media, or even on <a rel=\"noreferrer noopener\" href=\"https://neilpatel.com/ubersuggest/\" target=\"_blank\">ubersuggest</a> to see competitor website traffic and what posts have been most popular for them. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"className\":\"eplus-WBdsTr edplus_anim-BTxTeX\",\"textColor\":\"white\",\"style\":{\"typography\":{\"fontSize\":30}}} -->\n<h2 class=\"eplus-WBdsTr edplus_anim-BTxTeX has-white-color has-text-color\" style=\"font-size:30px\">Implementation.</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"className\":\"eplus-yKYMga edplus_anim-rlMgex\",\"textColor\":\"white\"} -->\n<p class=\"eplus-yKYMga edplus_anim-rlMgex has-white-color has-text-color\">After research, This is where the content is written, drafted, fact checked and published. We share to all your social channels and also look for ways to gain extra extra exposure such as publishing in relevant Facebook Groups, or on <a href=\"http://medium.com\" target=\"_blank\" rel=\"noreferrer noopener\">medium.</a> </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":1,\"className\":\"eplus-M3L3y7 edplus_anim-BC0Bwj\",\"textColor\":\"white\",\"style\":{\"typography\":{\"fontSize\":30}}} -->\n<h1 class=\"eplus-M3L3y7 edplus_anim-BC0Bwj has-white-color has-text-color\" style=\"font-size:30px\">Post campaign review. </h1>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"className\":\"eplus-R5iSYq edplus_anim-aQLBPT\",\"textColor\":\"white\"} -->\n<p class=\"eplus-R5iSYq edplus_anim-aQLBPT has-white-color has-text-color\">At end of month we will look at how your content has performed, traffic it has received and discuss opportunities to promote it further via paid social and paid search. We look at how we can build your audience over time, and how the content pieces form together as part of that puzzle. </p>\n<!-- /wp:paragraph --></div></div></div>\n<!-- /wp:genesis-blocks/gb-container -->\n\n<!-- wp:paragraph {\"className\":\"eplus-W0lMXv\"} -->\n<p class=\"eplus-W0lMXv\"> </p>\n<!-- /wp:paragraph --></div></div></div>\n<!-- /wp:genesis-blocks/gb-container -->\n\n<!-- wp:paragraph {\"className\":\"eplus-Gx0RWX\"} -->\n<p class=\"eplus-Gx0RWX\"></p>\n<!-- /wp:paragraph -->','Content-marketing','','publish','closed','closed','','content-marketing-2-2','','','2020-11-25 03:07:34','2020-11-25 03:07:34','',0,'https://alphaomegadigital.com.au/?page_id=9114',0,'page','',0),(9195,1,'2020-11-25 03:07:32','2020-11-25 03:07:32','<!-- wp:cover {\"url\":\"https://alphaomegadigital.com.au/wp-content/uploads/2017/07/studio-1.jpg\",\"id\":7294,\"hasParallax\":true,\"dimRatio\":93,\"minHeight\":800,\"gradient\":\"vivid-cyan-blue-to-vivid-purple\",\"align\":\"full\",\"className\":\"eplus-vKu94p\"} -->\n<div class=\"wp-block-cover alignfull has-background-dim-90 has-background-dim has-parallax has-background-gradient eplus-vKu94p\" style=\"background-image:url(https://alphaomegadigital.com.au/wp-content/uploads/2017/07/studio-1.jpg);min-height:800px\"><span aria-hidden=\"true\" class=\"wp-block-cover__gradient-background has-vivid-cyan-blue-to-vivid-purple-gradient-background\"></span><div class=\"wp-block-cover__inner-container\"><!-- wp:paragraph {\"align\":\"left\",\"placeholder\":\"Write title…\",\"className\":\"fade-in-up in viewport eplus-BvaxW7\",\"style\":{\"typography\":{\"fontSize\":58}}} -->\n<p class=\"has-text-align-left fade-in-up in viewport eplus-BvaxW7\" id=\"h1-hero\" style=\"font-size:58px\"><strong>Content Marketing</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns {\"align\":\"full\",\"className\":\"eplus-dvWM5D\"} -->\n<div class=\"wp-block-columns alignfull eplus-dvWM5D\"><!-- wp:column {\"className\":\"eplus-gPQdt3\"} -->\n<div class=\"wp-block-column eplus-gPQdt3\"><!-- wp:paragraph {\"className\":\"fade-in-up in viewport eplus-2ge0ev\",\"textColor\":\"white\"} -->\n<p class=\"fade-in-up in viewport eplus-2ge0ev has-white-color has-text-color\">Content is Queen. Well executed content is the greatest SEO strategy you will ever employ, and outranks any back end SEO endeavours you have tried before. One of the best things you can do for yourself long term is to have a content marketing strategy that is researched, planned and scheduled over the course of a year. Quality content gives you a higher ranking in google, and it\'s the driving force behind why visitors visit your website. Content builds authority, and is yet another form of social proof that represents your business as a trustworthy company that your clients want to buy from. </p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"width\":28.8,\"className\":\"eplus-XRmIW6\"} -->\n<div class=\"wp-block-column eplus-XRmIW6\" style=\"flex-basis:28.8%\"></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div></div>\n<!-- /wp:cover -->\n\n<!-- wp:genesis-blocks/gb-container {\"containerPaddingTop\":20,\"containerPaddingRight\":10,\"containerPaddingBottom\":0,\"containerPaddingLeft\":10,\"containerMarginBottom\":0,\"containerBackgroundColor\":\"#ffffff\",\"containerDimRatio\":10,\"align\":\"full\",\"className\":\"section-2\"} -->\n<div style=\"background-color:#ffffff;padding-left:10%;padding-right:10%;padding-top:20%\" class=\"wp-block-genesis-blocks-gb-container alignfull section-2 gb-block-container\"><div class=\"gb-container-inside\"><div class=\"gb-container-content\"><!-- wp:genesis-blocks/gb-container {\"containerPaddingBottom\":1.5,\"className\":\"c2\"} -->\n<div style=\"padding-bottom:1.5%\" class=\"wp-block-genesis-blocks-gb-container c2 gb-block-container\"><div class=\"gb-container-inside\"><div class=\"gb-container-content\"><!-- wp:block {\"ref\":9194} /--></div></div></div>\n<!-- /wp:genesis-blocks/gb-container --></div></div></div>\n<!-- /wp:genesis-blocks/gb-container -->\n\n<!-- wp:genesis-blocks/gb-container {\"containerPaddingTop\":0,\"containerPaddingRight\":0,\"containerPaddingBottom\":0,\"containerPaddingLeft\":0,\"containerMarginTop\":0,\"containerMarginBottom\":0,\"containerBackgroundColor\":\"#443d94\",\"containerDimRatio\":10,\"align\":\"full\"} -->\n<div style=\"background-color:#443d94\" class=\"wp-block-genesis-blocks-gb-container alignfull gb-block-container\"><div class=\"gb-container-inside\"><div class=\"gb-container-content\"><!-- wp:genesis-blocks/gb-container {\"containerPaddingTop\":5,\"containerPaddingRight\":10,\"containerPaddingBottom\":10,\"containerPaddingLeft\":10} -->\n<div style=\"padding-left:10%;padding-right:10%;padding-bottom:10%;padding-top:5%\" class=\"wp-block-genesis-blocks-gb-container gb-block-container\"><div class=\"gb-container-inside\"><div class=\"gb-container-content\"><!-- wp:heading {\"level\":1,\"className\":\"eplus-lYGRZY edplus_anim-SH79Is\",\"textColor\":\"white\",\"style\":{\"typography\":{\"fontSize\":70}}} -->\n<h1 class=\"eplus-lYGRZY edplus_anim-SH79Is has-white-color has-text-color\" style=\"font-size:70px\">The process</h1>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"className\":\"eplus-j6u9kJ edplus_anim-sG08BE\",\"textColor\":\"white\",\"style\":{\"typography\":{\"fontSize\":30}}} -->\n<h2 class=\"eplus-j6u9kJ edplus_anim-sG08BE has-white-color has-text-color\" style=\"font-size:30px\">Content Review</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"className\":\"eplus-L0uSie\"} -->\n<p class=\"eplus-L0uSie\"></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"eplus-Eih67u edplus_anim-vh41WR\",\"textColor\":\"white\"} -->\n<p class=\"eplus-Eih67u edplus_anim-vh41WR has-white-color has-text-color\">First we\'ll review your current content strategy (if you have one) and discuss how successful it has been for you so far. If you have never dabbled with content marketing before, we will discuss what content is most appropriate for your business and what resources, physical and financial are required to achieve your goals. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":1,\"className\":\"eplus-YCqLxp edplus_anim-Z2sxCF\",\"textColor\":\"white\",\"style\":{\"typography\":{\"fontSize\":30}}} -->\n<h1 class=\"eplus-YCqLxp edplus_anim-Z2sxCF has-white-color has-text-color\" style=\"font-size:30px\">Research.  </h1>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"className\":\"eplus-AKeSF4 edplus_anim-xvDrqz\",\"textColor\":\"white\"} -->\n<p class=\"eplus-AKeSF4 edplus_anim-xvDrqz has-white-color has-text-color\">At this stage I will conduct some content research to see what topics are sought after in your industry. I may check resources such as <a rel=\"noreferrer noopener\" href=\"http://feedly.com\" data-type=\"URL\" data-id=\"feedly.com\" target=\"_blank\">feedly</a> to see whats trending on social media, or even on <a rel=\"noreferrer noopener\" href=\"https://neilpatel.com/ubersuggest/\" target=\"_blank\">ubersuggest</a> to see competitor website traffic and what posts have been most popular for them. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"className\":\"eplus-WBdsTr edplus_anim-BTxTeX\",\"textColor\":\"white\",\"style\":{\"typography\":{\"fontSize\":30}}} -->\n<h2 class=\"eplus-WBdsTr edplus_anim-BTxTeX has-white-color has-text-color\" style=\"font-size:30px\">Implementation.</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"className\":\"eplus-yKYMga edplus_anim-rlMgex\",\"textColor\":\"white\"} -->\n<p class=\"eplus-yKYMga edplus_anim-rlMgex has-white-color has-text-color\">After research, This is where the content is written, drafted, fact checked and published. We share to all your social channels and also look for ways to gain extra extra exposure such as publishing in relevant Facebook Groups, or on <a href=\"http://medium.com\" target=\"_blank\" rel=\"noreferrer noopener\">medium.</a> </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":1,\"className\":\"eplus-M3L3y7 edplus_anim-BC0Bwj\",\"textColor\":\"white\",\"style\":{\"typography\":{\"fontSize\":30}}} -->\n<h1 class=\"eplus-M3L3y7 edplus_anim-BC0Bwj has-white-color has-text-color\" style=\"font-size:30px\">Post campaign review. </h1>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"className\":\"eplus-R5iSYq edplus_anim-aQLBPT\",\"textColor\":\"white\"} -->\n<p class=\"eplus-R5iSYq edplus_anim-aQLBPT has-white-color has-text-color\">At end of month we will look at how your content has performed, traffic it has received and discuss opportunities to promote it further via paid social and paid search. We look at how we can build your audience over time, and how the content pieces form together as part of that puzzle. </p>\n<!-- /wp:paragraph --></div></div></div>\n<!-- /wp:genesis-blocks/gb-container -->\n\n<!-- wp:paragraph {\"className\":\"eplus-W0lMXv\"} -->\n<p class=\"eplus-W0lMXv\"> </p>\n<!-- /wp:paragraph --></div></div></div>\n<!-- /wp:genesis-blocks/gb-container -->\n\n<!-- wp:paragraph {\"className\":\"eplus-Gx0RWX\"} -->\n<p class=\"eplus-Gx0RWX\"></p>\n<!-- /wp:paragraph -->','Content-marketing','','inherit','closed','closed','','9114-revision-v1','','','2020-11-25 03:07:32','2020-11-25 03:07:32','',9114,'https://alphaomegadigital.com.au/9114-revision-v1/',0,'revision','',0),(9110,1,'2020-11-23 05:17:19','2020-11-23 05:17:19','<!-- wp:cover {\"url\":\"https://alphaomegadigital.com.au/wp-content/uploads/2017/07/studio-1.jpg\",\"id\":7294,\"hasParallax\":true,\"dimRatio\":93,\"minHeight\":800,\"gradient\":\"vivid-cyan-blue-to-vivid-purple\",\"align\":\"full\",\"className\":\"eplus-vKu94p\"} -->\n<div class=\"wp-block-cover alignfull has-background-dim-90 has-background-dim has-parallax has-background-gradient eplus-vKu94p\" style=\"background-image:url(https://alphaomegadigital.com.au/wp-content/uploads/2017/07/studio-1.jpg);min-height:800px\"><span aria-hidden=\"true\" class=\"wp-block-cover__gradient-background has-vivid-cyan-blue-to-vivid-purple-gradient-background\"></span><div class=\"wp-block-cover__inner-container\"><!-- wp:paragraph {\"align\":\"left\",\"placeholder\":\"Write title…\",\"className\":\"fade-in-up in viewport eplus-BvaxW7\",\"style\":{\"typography\":{\"fontSize\":58}}} -->\n<p class=\"has-text-align-left fade-in-up in viewport eplus-BvaxW7\" id=\"h1-hero\" style=\"font-size:58px\"><strong>Digital Marketing</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns {\"align\":\"full\",\"className\":\"eplus-dvWM5D\"} -->\n<div class=\"wp-block-columns alignfull eplus-dvWM5D\"><!-- wp:column {\"className\":\"eplus-gPQdt3\"} -->\n<div class=\"wp-block-column eplus-gPQdt3\"><!-- wp:paragraph {\"className\":\"fade-in-up in viewport eplus-2ge0ev\",\"textColor\":\"white\"} -->\n<p class=\"fade-in-up in viewport eplus-2ge0ev has-white-color has-text-color\">As we enter the internet of things, people these days are spending 66 to 100 hours a month <a rel=\"noreferrer noopener\" href=\"https://www.statista.com/statistics/1112228/australia-average-total-time-spent-online-by-active-internet-users-smartphones-by-age-group/\" target=\"_blank\">online</a> and Australian businesses are spending more money than ever on digital marketing: in 2017 we spent 3.43 billion advertising online, and in 2019 we spent a whopping&nbsp;<a href=\"https://www.adnews.com.au/news/australian-brands-spent-9-4-billion-on-digital-ads-in-2019\">9.4 billion</a>, which is significantly higher than the previous forecast of 4.97 billion for&nbsp;<a href=\"https://www.adnews.com.au/news/digital-ad-spend-to-overtake-tv-in-2017-studies-find\">2019</a>. Together, we\'ll make sure you are allocating your spend correctly, and getting the most bang for your buck. It all starts with what content you are offering online, and how appealing that content is to your intended audience. Digital marketing also provides a something traditional media does not - transparency. You will know exactly how many people were reached for every campaign, post and email. </p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"width\":28.8,\"className\":\"eplus-XRmIW6\"} -->\n<div class=\"wp-block-column eplus-XRmIW6\" style=\"flex-basis:28.8%\"></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div></div>\n<!-- /wp:cover -->\n\n<!-- wp:genesis-blocks/gb-container {\"containerPaddingTop\":20,\"containerPaddingRight\":10,\"containerPaddingBottom\":0,\"containerPaddingLeft\":10,\"containerMarginBottom\":0,\"containerBackgroundColor\":\"#ffffff\",\"containerDimRatio\":10,\"align\":\"full\",\"className\":\"section-2\"} -->\n<div style=\"background-color:#ffffff;padding-left:10%;padding-right:10%;padding-top:20%\" class=\"wp-block-genesis-blocks-gb-container alignfull section-2 gb-block-container\"><div class=\"gb-container-inside\"><div class=\"gb-container-content\"><!-- wp:genesis-blocks/gb-container {\"containerPaddingBottom\":1.5,\"className\":\"c2\"} -->\n<div style=\"paddi