or:#ffffff\">Digital Marketing</h2>\n<!-- /wp:heading -->\n\n<!-- wp:genesis-blocks/gb-button {\"buttonText\":\"learn more\",\"buttonAlignment\":\"center\",\"buttonSize\":\"gb-button-size-small\",\"buttonShape\":\"gb-button-shape-circular\"} -->\n<div style=\"text-align:center\" class=\"wp-block-genesis-blocks-gb-button gb-block-button\"><a href=\"https://alphaomegadigital.com.au/digital-marketing/\" class=\"gb-button gb-button-shape-circular gb-button-size-small\" style=\"color:#ffffff;background-color:#3373dc\">learn more</a></div>\n<!-- /wp:genesis-blocks/gb-button --></div></div></div>\n<!-- /wp:genesis-blocks/gb-container --></div></div></div>\n<!-- /wp:genesis-blocks/gb-container --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"className\":\"eplus-VplWPa\"} -->\n<div class=\"wp-block-column eplus-VplWPa\"><!-- wp:genesis-blocks/gb-container {\"containerPaddingTop\":5,\"containerPaddingRight\":7,\"containerPaddingBottom\":5,\"containerPaddingLeft\":7,\"containerMarginBottom\":0,\"containerBackgroundColor\":\"#443d94\",\"className\":\"c2-child\"} -->\n<div style=\"background-color:#443d94;padding-left:7%;padding-right:7%;padding-bottom:5%;padding-top:5%\" class=\"wp-block-genesis-blocks-gb-container c2-child gb-block-container\"><div class=\"gb-container-inside\"><div class=\"gb-container-content\"><!-- wp:genesis-blocks/gb-container {\"containerPaddingTop\":5,\"containerPaddingRight\":3,\"containerPaddingBottom\":5,\"containerPaddingLeft\":3,\"containerMarginBottom\":0,\"containerBackgroundColor\":\"#000000\",\"className\":\"c2-child-content\"} -->\n<div style=\"background-color:#000000;padding-left:3%;padding-right:3%;padding-bottom:5%;padding-top:5%\" class=\"wp-block-genesis-blocks-gb-container c2-child-content gb-block-container\"><div class=\"gb-container-inside\"><div class=\"gb-container-content\"><!-- wp:image {\"align\":\"center\",\"id\":8401,\"width\":60,\"height\":60,\"sizeSlug\":\"large\"} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-large is-resized\"><img src=\"https://alphaomegadigital.com.au/wp-content/uploads/2020/11/wordpress.svg\" alt=\"wordpress-white svg\" class=\"wp-image-8401\" width=\"60\" height=\"60\"/></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:heading {\"align\":\"center\",\"className\":\"eplus-NFzCm4\",\"style\":{\"color\":{\"text\":\"#ffffff\"},\"typography\":{\"fontSize\":17}}} -->\n<h2 class=\"has-text-align-center eplus-NFzCm4 has-text-color\" style=\"font-size:17px;color:#ffffff\">Wordpress Development</h2>\n<!-- /wp:heading -->\n\n<!-- wp:genesis-blocks/gb-button {\"buttonText\":\"learn more\",\"buttonAlignment\":\"center\",\"buttonSize\":\"gb-button-size-small\",\"buttonShape\":\"gb-button-shape-circular\"} -->\n<div style=\"text-align:center\" class=\"wp-block-genesis-blocks-gb-button gb-block-button\"><a href=\"https://alphaomegadigital.com.au/web-development-2/\" class=\"gb-button gb-button-shape-circular gb-button-size-small\" style=\"color:#ffffff;background-color:#3373dc\">learn more</a></div>\n<!-- /wp:genesis-blocks/gb-button --></div></div></div>\n<!-- /wp:genesis-blocks/gb-container --></div></div></div>\n<!-- /wp:genesis-blocks/gb-container --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"className\":\"eplus-v2bQKP\"} -->\n<div class=\"wp-block-column eplus-v2bQKP\"><!-- wp:genesis-blocks/gb-container {\"containerPaddingTop\":5,\"containerPaddingRight\":7,\"containerPaddingBottom\":5,\"containerPaddingLeft\":7,\"containerMarginBottom\":0,\"containerBackgroundColor\":\"#2b2663\",\"className\":\"c2-child\"} -->\n<div style=\"background-color:#2b2663;padding-left:7%;padding-right:7%;padding-bottom:5%;padding-top:5%\" class=\"wp-block-genesis-blocks-gb-container c2-child gb-block-container\"><div class=\"gb-container-inside\"><div class=\"gb-container-content\"><!-- wp:genesis-blocks/gb-container {\"containerPaddingTop\":5,\"containerPaddingRight\":3,\"containerPaddingBottom\":5,\"containerPaddingLeft\":3,\"containerMarginBottom\":0,\"containerBackgroundColor\":\"#443d94\",\"className\":\"c2-child-content\"} -->\n<div style=\"background-color:#443d94;padding-left:3%;padding-right:3%;padding-bottom:5%;padding-top:5%\" class=\"wp-block-genesis-blocks-gb-container c2-child-content gb-block-container\"><div class=\"gb-container-inside\"><div class=\"gb-container-content\"><!-- wp:image {\"align\":\"center\",\"id\":8402,\"width\":60,\"height\":60,\"sizeSlug\":\"large\"} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-large is-resized\"><img src=\"https://alphaomegadigital.com.au/wp-content/uploads/2020/11/writing.svg\" alt=\"writing-white-svg\" class=\"wp-image-8402\" width=\"60\" height=\"60\"/></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:heading {\"align\":\"center\",\"className\":\"eplus-dYwNcD\",\"style\":{\"color\":{\"text\":\"#ffffff\"},\"typography\":{\"fontSize\":17}}} -->\n<h2 class=\"has-text-align-center eplus-dYwNcD has-text-color\" style=\"font-size:17px;color:#ffffff\">Content Marketing</h2>\n<!-- /wp:heading -->\n\n<!-- wp:genesis-blocks/gb-button {\"buttonText\":\"learn more\",\"buttonAlignment\":\"center\",\"buttonSize\":\"gb-button-size-small\",\"buttonShape\":\"gb-button-shape-circular\"} -->\n<div style=\"text-align:center\" class=\"wp-block-genesis-blocks-gb-button gb-block-button\"><a href=\"https://alphaomegadigital.com.au/content-marketing-2/\" class=\"gb-button gb-button-shape-circular gb-button-size-small\" style=\"color:#ffffff;background-color:#3373dc\">learn more</a></div>\n<!-- /wp:genesis-blocks/gb-button --></div></div></div>\n<!-- /wp:genesis-blocks/gb-container --></div></div></div>\n<!-- /wp:genesis-blocks/gb-container --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div></div></div>\n<!-- /wp:genesis-blocks/gb-container -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div></div></div>\n<!-- /wp:genesis-blocks/gb-container -->\n\n<!-- wp:genesis-blocks/gb-container {\"containerPaddingTop\":0,\"containerPaddingRight\":0,\"containerPaddingBottom\":0,\"containerPaddingLeft\":0,\"containerMarginTop\":0,\"containerMarginBottom\":0,\"containerBackgroundColor\":\"#443d94\",\"containerDimRatio\":10,\"align\":\"full\"} -->\n<div style=\"background-color:#443d94\" class=\"wp-block-genesis-blocks-gb-container alignfull gb-block-container\"><div class=\"gb-container-inside\"><div class=\"gb-container-content\"><!-- wp:genesis-blocks/gb-container {\"containerPaddingTop\":5,\"containerPaddingRight\":10,\"containerPaddingBottom\":10,\"containerPaddingLeft\":10} -->\n<div style=\"padding-left:10%;padding-right:10%;padding-bottom:10%;padding-top:5%\" class=\"wp-block-genesis-blocks-gb-container gb-block-container\"><div class=\"gb-container-inside\"><div class=\"gb-container-content\"><!-- wp:heading {\"level\":1,\"className\":\"eplus-lYGRZY edplus_anim-SH79Is\",\"textColor\":\"white\",\"style\":{\"typography\":{\"fontSize\":70}}} -->\n<h1 class=\"eplus-lYGRZY edplus_anim-SH79Is has-white-color has-text-color\" style=\"font-size:70px\">The process</h1>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"className\":\"eplus-j6u9kJ edplus_anim-sG08BE\",\"textColor\":\"white\",\"style\":{\"typography\":{\"fontSize\":30}}} -->\n<h2 class=\"eplus-j6u9kJ edplus_anim-sG08BE has-white-color has-text-color\" style=\"font-size:30px\">Needs Analysis. </h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"className\":\"eplus-L0uSie\"} -->\n<p class=\"eplus-L0uSie\"></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"eplus-Eih67u edplus_anim-vh41WR\",\"textColor\":\"white\"} -->\n<p class=\"eplus-Eih67u edplus_anim-vh41WR has-white-color has-text-color\">At our first meeting we will uncover your business needs, and how many of them can be addressed for the budget you can allocate. You will advise me on what needs you believe are pertinent to your business, and I will advise you on needs you have that you may not be aware of. This is a symbiotic process between the marketer and the business, to agree on the best approach going forward.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":1,\"className\":\"eplus-YCqLxp edplus_anim-Z2sxCF\",\"textColor\":\"white\",\"style\":{\"typography\":{\"fontSize\":30}}} -->\n<h1 class=\"eplus-YCqLxp edplus_anim-Z2sxCF has-white-color has-text-color\" style=\"font-size:30px\">Review. </h1>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"className\":\"eplus-AKeSF4 edplus_anim-xvDrqz\",\"textColor\":\"white\"} -->\n<p class=\"eplus-AKeSF4 edplus_anim-xvDrqz has-white-color has-text-color\">After uncovering your needs at our first meeting, I will pull your data into <a rel=\"noreferrer noopener\" href=\"http://databox.com\" data-type=\"URL\" data-id=\"databox.com\" target=\"_blank\">databox</a> and conduct a <a rel=\"noreferrer noopener\" href=\"https://www.business.qld.gov.au/starting-business/planning/market-customer-research/swot-analysis\" target=\"_blank\">SWOT</a> analysis and identify your businesses greatest marketing challenges. I will analyse what current implementations are working for you and those which are not. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":1,\"className\":\"eplus-XLk7Gh edplus_anim-oB3Ash\",\"textColor\":\"white\",\"style\":{\"typography\":{\"fontSize\":30}}} -->\n<h1 class=\"eplus-XLk7Gh edplus_anim-oB3Ash has-white-color has-text-color\" style=\"font-size:30px\">Planning</h1>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"className\":\"eplus-MQvcbS edplus_anim-a9XF3S\",\"textColor\":\"white\"} -->\n<p class=\"eplus-MQvcbS edplus_anim-a9XF3S has-white-color has-text-color\">At this stage I will compile a plan that encompasses all facets of marketing that can help your business and provide you with a quote. The strategies outlined will be listed in terms of priority, and you may choose to green light all of them or some of them depending on your time constraints. Ultimately it\'s your business, and you are in control of this decision. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"className\":\"eplus-WBdsTr edplus_anim-BTxTeX\",\"textColor\":\"white\",\"style\":{\"typography\":{\"fontSize\":30}}} -->\n<h2 class=\"eplus-WBdsTr edplus_anim-BTxTeX has-white-color has-text-color\" style=\"font-size:30px\">Implementation.</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"className\":\"eplus-yKYMga edplus_anim-rlMgex\",\"textColor\":\"white\"} -->\n<p class=\"eplus-yKYMga edplus_anim-rlMgex has-white-color has-text-color\">Once you\'ve given the green light, I will being implementing the strategies we have agreed upon, and provide you updates throughout the month as the campaign continues. You will receive a report at the end of the month outlining the money spend vs the reach, engagement and sales acquired. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":1,\"className\":\"eplus-M3L3y7 edplus_anim-BC0Bwj\",\"textColor\":\"white\",\"style\":{\"typography\":{\"fontSize\":30}}} -->\n<h1 class=\"eplus-M3L3y7 edplus_anim-BC0Bwj has-white-color has-text-color\" style=\"font-size:30px\">Final Review. </h1>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"className\":\"eplus-R5iSYq edplus_anim-aQLBPT\",\"textColor\":\"white\"} -->\n<p class=\"eplus-R5iSYq edplus_anim-aQLBPT has-white-color has-text-color\">At end of month we will discuss the marketing strategies and assess them against the KPI\'s set in <a rel=\"noreferrer noopener\" href=\"http://databox.com\" data-type=\"URL\" data-id=\"databox.com\" target=\"_blank\">databox</a>. Pending results, we will discuss the best options going forward and what tweaks can be made to ensure continued success. </p>\n<!-- /wp:paragraph --></div></div></div>\n<!-- /wp:genesis-blocks/gb-container -->\n\n<!-- wp:paragraph {\"className\":\"eplus-W0lMXv\"} -->\n<p class=\"eplus-W0lMXv\"> </p>\n<!-- /wp:paragraph --></div></div></div>\n<!-- /wp:genesis-blocks/gb-container -->\n\n<!-- wp:paragraph {\"className\":\"eplus-Gx0RWX\"} -->\n<p class=\"eplus-Gx0RWX\"></p>\n<!-- /wp:paragraph -->','Digital-marketing','','publish','closed','closed','','digital-marketing','','','2020-11-25 03:12:16','2020-11-25 03:12:16','',0,'https://alphaomegadigital.com.au/?page_id=9110',0,'page','',0),(9197,1,'2020-11-25 03:12:15','2020-11-25 03:12:15','<!-- wp:cover {\"url\":\"https://alphaomegadigital.com.au/wp-content/uploads/2017/07/studio-1.jpg\",\"id\":7294,\"hasParallax\":true,\"dimRatio\":93,\"minHeight\":800,\"gradient\":\"vivid-cyan-blue-to-vivid-purple\",\"align\":\"full\",\"className\":\"eplus-vKu94p\"} -->\n<div class=\"wp-block-cover alignfull has-background-dim-90 has-background-dim has-parallax has-background-gradient eplus-vKu94p\" style=\"background-image:url(https://alphaomegadigital.com.au/wp-content/uploads/2017/07/studio-1.jpg);min-height:800px\"><span aria-hidden=\"true\" class=\"wp-block-cover__gradient-background has-vivid-cyan-blue-to-vivid-purple-gradient-background\"></span><div class=\"wp-block-cover__inner-container\"><!-- wp:paragraph {\"align\":\"left\",\"placeholder\":\"Write title…\",\"className\":\"fade-in-up in viewport eplus-BvaxW7\",\"style\":{\"typography\":{\"fontSize\":58}}} -->\n<p class=\"has-text-align-left fade-in-up in viewport eplus-BvaxW7\" id=\"h1-hero\" style=\"font-size:58px\"><strong>Digital Marketing</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns {\"align\":\"full\",\"className\":\"eplus-dvWM5D\"} -->\n<div class=\"wp-block-columns alignfull eplus-dvWM5D\"><!-- wp:column {\"className\":\"eplus-gPQdt3\"} -->\n<div class=\"wp-block-column eplus-gPQdt3\"><!-- wp:paragraph {\"className\":\"fade-in-up in viewport eplus-2ge0ev\",\"textColor\":\"white\"} -->\n<p class=\"fade-in-up in viewport eplus-2ge0ev has-white-color has-text-color\">As we enter the internet of things, people these days are spending 66 to 100 hours a month <a rel=\"noreferrer noopener\" href=\"https://www.statista.com/statistics/1112228/australia-average-total-time-spent-online-by-active-internet-users-smartphones-by-age-group/\" target=\"_blank\">online</a> and Australian businesses are spending more money than ever on digital marketing: in 2017 we spent 3.43 billion advertising online, and in 2019 we spent a whopping&nbsp;<a href=\"https://www.adnews.com.au/news/australian-brands-spent-9-4-billion-on-digital-ads-in-2019\">9.4 billion</a>, which is significantly higher than the previous forecast of 4.97 billion for&nbsp;<a href=\"https://www.adnews.com.au/news/digital-ad-spend-to-overtake-tv-in-2017-studies-find\">2019</a>. Together, we\'ll make sure you are allocating your spend correctly, and getting the most bang for your buck. It all starts with what content you are offering online, and how appealing that content is to your intended audience. Digital marketing also provides a something traditional media does not - transparency. You will know exactly how many people were reached for every campaign, post and email. </p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"width\":28.8,\"className\":\"eplus-XRmIW6\"} -->\n<div class=\"wp-block-column eplus-XRmIW6\" style=\"flex-basis:28.8%\"></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div></div>\n<!-- /wp:cover -->\n\n<!-- wp:genesis-blocks/gb-container {\"containerPaddingTop\":20,\"containerPaddingRight\":10,\"containerPaddingBottom\":0,\"containerPaddingLeft\":10,\"containerMarginBottom\":0,\"containerBackgroundColor\":\"#ffffff\",\"containerDimRatio\":10,\"align\":\"full\",\"className\":\"section-2\"} -->\n<div style=\"background-color:#ffffff;padding-left:10%;padding-right:10%;padding-top:20%\" class=\"wp-block-genesis-blocks-gb-container alignfull section-2 gb-block-container\"><div class=\"gb-container-inside\"><div class=\"gb-container-content\"><!-- wp:genesis-blocks/gb-container {\"containerPaddingBottom\":1.5,\"className\":\"c2\"} -->\n<div style=\"padding-bottom:1.5%\" class=\"wp-block-genesis-blocks-gb-container c2 gb-block-container\"><div class=\"gb-container-inside\"><div class=\"gb-container-content\"><!-- wp:columns {\"className\":\"eplus-gdflZ1\"} --