 of new potential customers and partners. \r\nYou will need exactly one minute to leave an application: \r\nhttp://bit.do/directorybusiness \r\nSuccess in business!\nSend now\nNo\n4\n94.103.95.137\nMozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/65.0.3325.181 Safari/537.36\nhttps://alphaomegadigital.com.au/contact-2/\nOctober 29, 2020\n5:17 am\n7443\ncontact-2\nContact\nhttps://alphaomegadigital.com.au/contact-2/\nJane James\nalphaomegadigitalau@gmail.com\nAlpha Omega Digital\nSmall business happiness specialist\nhttps://alphaomegadigital.com.au\nalphaomegadigitalau@gmail.com','We will post data about your company in the business directory for free.','','trash','closed','closed','','we-will-post-data-about-your-company-in-the-business-directory-for-free__trashed','','','2020-11-29 03:27:31','2020-11-29 03:27:31','',0,'https://alphaomegadigital.com.au/?post_type=flamingo_inbound&#038;p=8007',0,'flamingo_inbound','',0),(7238,1,'2020-07-31 05:47:58','2020-07-31 05:47:58','','Web Development','','publish','closed','closed','','map-2','','','2020-08-05 02:02:38','2020-08-05 02:02:38','',0,'http://alphaomegadigital.com.au/map-2/',11,'nav_menu_item','',0),(7239,1,'2020-07-31 05:47:58','2020-07-31 05:47:58','','Email','','publish','closed','closed','','sign-out-3','','','2020-08-05 02:11:16','2020-08-05 02:11:16','',0,'http://alphaomegadigital.com.au/sign-out-3/',14,'nav_menu_item','',0),(66,1,'2017-04-05 15:36:09','2017-04-05 15:36:09','I can\'t say enough about Studio Pro. Thanks to Studio Pro, we\'ve just launched our 5th website! Studio Pro is worth much more than I paid.','Todd Smith','','publish','closed','closed','','sarah-jones','','','2017-04-05 15:36:09','2017-04-05 15:36:09','',0,'http://studio.dev/?post_type=testimonial&amp;p=66',0,'testimonial','',0),(68,1,'2017-04-05 15:36:13','2017-04-05 15:36:13','Needless to say we are extremely satisfied with the results. I like Studio Pro more and more each day because it makes my life a lot easier. After using Studio Pro my business skyrocketed!','Emma Jones','','publish','closed','closed','','sarah-jones-2','','','2017-04-05 15:36:13','2017-04-05 15:36:13','',0,'http://studio.dev/?testimonial=sarah-jones-copy',0,'testimonial','',0),(7637,1,'2020-08-05 04:14:12','2020-08-05 04:14:12','','choosetemplateFB','','inherit','open','closed','','choosetemplatefb','','','2020-08-05 04:19:54','2020-08-05 04:19:54','',7324,'http://alphaomegadigital.com.au/wp-content/uploads/2020/07/choosetemplateFB.png',0,'attachment','image/png',0),(7324,1,'2020-07-31 10:56:05','2020-07-31 10:56:05','<!-- wp:paragraph -->\n<p>So you\'re tasked with setting up your business Facebook page, and you have no idea what you\'re doing. Or you have a Facebook business page but it\'s not setup optimally. Don\'t fret, this walkthrough is for you!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":7638,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://alphaomegadigital.com.au/wp-content/uploads/2020/07/creataccFB-1024x460.png\" alt=\"business manager img\" class=\"wp-image-7638\"/><figcaption>First you\'re going to go to Facebook Business Manager and create an account. </figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":7640,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://alphaomegadigital.com.au/wp-content/uploads/2020/07/createpageFBBusiness-1024x447.png\" alt=\"create page Facebook business\" class=\"wp-image-7640\"/><figcaption>Next, you\'re going to \"Add\"a page from your Facebook console. </figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":7637,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://alphaomegadigital.com.au/wp-content/uploads/2020/07/choosetemplateFB-1024x473.png\" alt=\"Choose Facebook page template\" class=\"wp-image-7637\"/><figcaption>On the left menu, select templates and tabs. Choose the template that is most applicable to your business. </figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":7641,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://alphaomegadigital.com.au/wp-content/uploads/2020/07/pageuserFB-1024x469.png\" alt=\"Facebook business page user\" class=\"wp-image-7641\"/><figcaption>Create your username/ Facebook handle. Try and match the page name, and if it\'s not available try adding your country extension on the end. In my case its AU</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":7648,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://alphaomegadigital.com.au/wp-content/uploads/2020/08/getstartedfb-1024x433.png\" alt=\"\" class=\"wp-image-7648\"/><figcaption>Click on the get started button and enter business details. This one is pretty self explanatory. </figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":7639,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://alphaomegadigital.com.au/wp-content/uploads/2020/07/createbuttonFB-1024x448.png\" alt=\"CTA button Facebook business\" class=\"wp-image-7639\"/><figcaption>Click \"add button\" to create a call to action offer. This can be a free consult, a quote, or a discount. Pages with CTA\'s are more likely to get enquiries than those without. Also at this stage you should set your cover image. I didn\'t want a cheesy stock photo so I took a screenshot of my homepage. </figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":7644,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://alphaomegadigital.com.au/wp-content/uploads/2020/07/visitor-postsfb-1024x470.png\" alt=\"Visitor post settings Facebook\" class=\"wp-image-7644\"/><figcaption>Under your settings tab, go to visitor posts. I suggest disabling anyone from being able to post to the page. In the years I\'ve managed social accounts, I have seen competitors and even strangers post irrelevant content such as things promoting their business and so on. Some people can be downright nasty.  This is the kind of thing that will keep you up at night and trust me you don\'t want this. </figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":7642,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://alphaomegadigital.com.au/wp-content/uploads/2020/07/profanityFB-1024x449.png\" alt=\"profanity Facebook filkter\" class=\"wp-image-7642\"/><figcaption>The other setting that is a must is the profanity filter. I set mine set as strong. We all know there are crazies on the internet, and the last thing you want is your brand being tarnished by hateful or abusive language. Do yourself a favour and turn it on. </figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":7649,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://alphaomegadigital.com.au/wp-content/uploads/2020/08/invitefriends-1024x453.png\" alt=\"\" class=\"wp-image-7649\"/><figcaption>Don\'t forget to invite your friends to like your page. Facebook will auto populate your friends list, and you can also add anyone by inviting them on email. </figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:heading -->\n<h2>Want to gain some traction?</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>You have successfully setup your Facebook page. A hundred of your friends liked it. Cool. But what next? I strongly advise the following steps to build your page followers and network amongst other businesses</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>1. Google your area - suburb, municipality, town (each of these will usually have a seperate page) and join the groups. Don\'t post until you read the group rules. For example my town group has a rule that businesses can only promote themselves on Wednesdays. This is to keep the group focused on community issues, and ensure it\'s not one big giant business spam. Take advantage of this opportunity to spruik yourself and stick to the self promotion guidelines. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>2. Create a Facebook group and be the admin. Post helpful content.   Genuinely try and help people. Admin it properly, and make sure people behave and adhere to facebooks anti bullying guidelines. Make the group name general, such as \"marketing help for small businesses.\" Stay away from memes and cat videos. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>3. Setup a Facebook advertising schedule to promote your free group. Set your budget at $3 a day. Continue to provide value and post helpful content, and don\'t forget to answer questions. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>4. Use an auto publishing blog to social tool such as <a href=\"https://wordpress.org/plugins/blog2social/\">blog2social</a> or <a href=\"https://ifttt.com/\">IFTTT. </a>This saves you copying and pasting blog URL\'s to your social channels, and also makes sure you don\'t forget to do it.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>5. Network with other complementary businesses in your area. Like and follow their pages, and private message them to see if you can work together. Focus on the ones that respond and are open to the idea, and accept that some wont be. Organise coffee with the ones that are keen, and get some face to face time with them. You have a much greater chance of closing a deal face to face than you do online. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>There is so much more I would write on this topic, but for now let\'s leave it at that! I will be writing more posts about Facebook advertising, getting email subscribers and optimising ad campaigns so be sure to check those out when they\'re featured on the blog. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Did you set this up? How did you go? Be sure to reach out and let me know if you found this setup process easy. </p>\n<!-- /wp:paragraph -->','Setup and grow your Facebook business page','','private','open','open','','social-media-trends-2020','','','2020-11-25 05:00:37','2020-11-25 05:00:37','',0,'http://alphaomegadigital.com.au/?p=7324',0,'post','',0),(9212,1,'2020-11-25 04:54:19','2020-11-25 04:54:19','<!-- wp:paragraph -->\n<p>So you\'re tasked with setting up your business Facebook page, and you have no idea what you\'re doing. Or you have a Facebook business page but it\'s not setup optimally. Don\'t fret, this walkthrough is for you!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":7638,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://alphaomegadigital.com.au/wp-content/uploads/2020/07/creataccFB-1024x460.png\" alt=\"business manager img\" class=\"wp-image-7638\"/><figcaption>First you\'re going to go to Facebook Business Manager and create an account. </figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":7640,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://alphaomegadigital.com.au/wp-content/uploads/2020/07/createpageFBBusiness-1024x447.png\" alt=\"create page Facebook business\" class=\"wp-image-7640\"/><figcaption>Next, you\'re going to \"Add\"a page from your Facebook console. </figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":7637,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://alphaomegadigital.com.au/wp-content/uploads/2020/07/choosetemplateFB-1024x473.png\" alt=\"Choose Facebook page template\" class=\"wp-image-7637\"/><figcaption>On the left menu, select templates and tabs. Choose the template that is most applicable to your business. </figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":7641,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://alphaomegadigital.com.au/wp-cont