\":\"c2-child\"} -->\n<div style=\"background-color:#2b2663;padding-left:7%;padding-right:7%;padding-bottom:5%;padding-top:5%\" class=\"wp-block-genesis-blocks-gb-container c2-child gb-block-container\"><div class=\"gb-container-inside\"><div class=\"gb-container-content\"><!-- wp:genesis-blocks/gb-container {\"containerPaddingTop\":5,\"containerPaddingRight\":3,\"containerPaddingBottom\":5,\"containerPaddingLeft\":3,\"containerMarginBottom\":0,\"containerBackgroundColor\":\"#443d94\",\"className\":\"c2-child-content\"} -->\n<div style=\"background-color:#443d94;padding-left:3%;padding-right:3%;padding-bottom:5%;padding-top:5%\" class=\"wp-block-genesis-blocks-gb-container c2-child-content gb-block-container\"><div class=\"gb-container-inside\"><div class=\"gb-container-content\"><!-- wp:shortcode {\"epGeneratedClass\":\"eplus-YGOshI\",\"epAnimationGeneratedClass\":\"edplus_anim-cTa4YO\"} -->\n[bodymovin anim_id=\"8506\" loop=\"true\" lazyload=\"true\" width=\"80px\" align=\"center\"]\n<!-- /wp:shortcode -->\n\n<!-- wp:heading {\"align\":\"center\",\"className\":\"eplus-dYwNcD\",\"style\":{\"color\":{\"text\":\"#ffffff\"},\"typography\":{\"fontSize\":17}},\"epGeneratedClass\":\"eplus-dYwNcD\",\"epAnimationGeneratedClass\":\"edplus_anim-YtREnN\"} -->\n<h2 class=\"has-text-align-center eplus-dYwNcD has-text-color\" style=\"font-size:17px;color:#ffffff\">Content Marketing</h2>\n<!-- /wp:heading -->\n\n<!-- wp:genesis-blocks/gb-button {\"buttonText\":\"learn more\",\"buttonAlignment\":\"center\",\"buttonSize\":\"gb-button-size-small\",\"buttonShape\":\"gb-button-shape-circular\"} -->\n<div style=\"text-align:center\" class=\"wp-block-genesis-blocks-gb-button gb-block-button\"><a href=\"https://alphaomegadigital.com.au/content-marketing-2/\" class=\"gb-button gb-button-shape-circular gb-button-size-small\" style=\"color:#ffffff;background-color:#3373dc\">learn more</a></div>\n<!-- /wp:genesis-blocks/gb-button --></div></div></div>\n<!-- /wp:genesis-blocks/gb-container --></div></div></div>\n<!-- /wp:genesis-blocks/gb-container --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div></div></div>\n<!-- /wp:genesis-blocks/gb-container --></div></div></div>\n<!-- /wp:genesis-blocks/gb-container -->\n\n<!-- wp:genesis-blocks/gb-container {\"containerPaddingTop\":0,\"containerPaddingRight\":0,\"containerPaddingBottom\":0,\"containerPaddingLeft\":0,\"containerMarginTop\":0,\"containerMarginBottom\":0,\"containerBackgroundColor\":\"#443d94\",\"containerDimRatio\":10,\"align\":\"full\"} -->\n<div style=\"background-color:#443d94\" class=\"wp-block-genesis-blocks-gb-container alignfull gb-block-container\"><div class=\"gb-container-inside\"><div class=\"gb-container-content\"><!-- wp:genesis-blocks/gb-container {\"containerPaddingTop\":5,\"containerPaddingRight\":10,\"containerPaddingBottom\":10,\"containerPaddingLeft\":10} -->\n<div style=\"padding-left:10%;padding-right:10%;padding-bottom:10%;padding-top:5%\" class=\"wp-block-genesis-blocks-gb-container gb-block-container\"><div class=\"gb-container-inside\"><div class=\"gb-container-content\"><!-- wp:heading {\"level\":1,\"className\":\"eplus-lYGRZY edplus_anim-SH79Is\",\"textColor\":\"white\",\"style\":{\"typography\":{\"fontSize\":70}},\"epGeneratedClass\":\"eplus-lYGRZY\",\"epCustomAnimation\":{\"type\":\"roll\",\"duration\":1,\"direction\":\"center\",\"delay\":0,\"speedCurve\":\"ease-in\",\"repeat\":\"once\"},\"epAnimationGeneratedClass\":\"edplus_anim-SH79Is\"} -->\n<h1 class=\"eplus-lYGRZY edplus_anim-SH79Is has-white-color has-text-color\" style=\"font-size:70px\">The process</h1>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"className\":\"eplus-jjoC7Z\",\"epGeneratedClass\":\"eplus-jjoC7Z\",\"epAnimationGeneratedClass\":\"edplus_anim-tO5Lf7\"} -->\n<p class=\"eplus-jjoC7Z\"></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:genesis-blocks/gb-container {\"containerPaddingTop\":3} -->\n<div style=\"padding-top:3%\" class=\"wp-block-genesis-blocks-gb-container gb-block-container\"><div class=\"gb-container-inside\"><div class=\"gb-container-content\"></div></div></div>\n<!-- /wp:genesis-blocks/gb-container -->\n\n<!-- wp:paragraph {\"className\":\"eplus-Eih67u edplus_anim-vh41WR\",\"textColor\":\"white\",\"epGeneratedClass\":\"eplus-Eih67u\",\"epCustomAnimation\":{\"type\":\"bounce\",\"duration\":1,\"direction\":\"center\",\"delay\":0,\"speedCurve\":\"ease-in\",\"repeat\":\"once\"},\"epAnimationGeneratedClass\":\"edplus_anim-vh41WR\"} -->\n<p class=\"eplus-Eih67u edplus_anim-vh41WR has-white-color has-text-color\">The very first step is connecting your website and socials to <a href=\"http://databox.com\" data-type=\"URL\" data-id=\"databox.com\">Databox.</a> This gives us a clear starting point of where you are at with site traffic, organic search, paid search, social traffic, conversion rates and more. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"eplus-WnUIjG edplus_anim-nyHu7Z\",\"textColor\":\"white\",\"epGeneratedClass\":\"eplus-WnUIjG\",\"epCustomAnimation\":{\"type\":\"bounce\",\"duration\":1,\"direction\":\"center\",\"delay\":0,\"speedCurve\":\"ease-in\",\"repeat\":\"once\"},\"epAnimationGeneratedClass\":\"edplus_anim-nyHu7Z\"} -->\n<p class=\"eplus-WnUIjG edplus_anim-nyHu7Z has-white-color has-text-color\">Your databoard will be setup, and all your data saved. This allows for a comparison point in the future to refer back to. This is the stage where we set goals and KPI\'s</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"eplus-PMqt5f edplus_anim-X4u53C\",\"textColor\":\"white\",\"epGeneratedClass\":\"eplus-PMqt5f\",\"epCustomAnimation\":{\"type\":\"bounce\",\"duration\":1,\"direction\":\"center\",\"delay\":0,\"speedCurve\":\"ease-in\",\"repeat\":\"once\"},\"epAnimationGeneratedClass\":\"edplus_anim-X4u53C\"} -->\n<p class=\"eplus-PMqt5f edplus_anim-X4u53C has-white-color has-text-color\">Your website project is mocked up. You will receive a style guide, basic page mockup for each page, and set of assets including icons and images to approve for your website. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"eplus-gquI0c edplus_anim-Na24gZ\",\"textColor\":\"white\",\"epGeneratedClass\":\"eplus-gquI0c\",\"epCustomAnimation\":{\"type\":\"bounce\",\"duration\":1,\"direction\":\"center\",\"delay\":0,\"speedCurve\":\"ease-in\",\"repeat\":\"once\"},\"epAnimationGeneratedClass\":\"edplus_anim-Na24gZ\"} -->\n<p class=\"eplus-gquI0c edplus_anim-Na24gZ has-white-color has-text-color\">You website is built on a staging domain. Although we will pre define the pages, you will be involved in the consultation process and be updated throughout the build process.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"eplus-hIFNmD edplus_anim-fdWr1z\",\"textColor\":\"white\",\"epGeneratedClass\":\"eplus-hIFNmD\",\"epCustomAnimation\":{\"type\":\"bounce\",\"duration\":1,\"direction\":\"center\",\"delay\":0,\"speedCurve\":\"ease-in\",\"repeat\":\"once\"},\"epAnimationGeneratedClass\":\"edplus_anim-fdWr1z\"} -->\n<p class=\"eplus-hIFNmD edplus_anim-fdWr1z has-white-color has-text-color\">Your website is transferred to your custom domain. We will complete any last minute touches needed such as Google analytics, backlinks and social buttons. We also create an offer/opt in for you to build your email list. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"eplus-lIZWW6 edplus_anim-zOPVId\",\"textColor\":\"white\",\"epGeneratedClass\":\"eplus-lIZWW6\",\"epCustomAnimation\":{\"type\":\"bounce\",\"duration\":1,\"direction\":\"center\",\"delay\":0,\"speedCurve\":\"ease-in\",\"repeat\":\"once\"},\"epAnimationGeneratedClass\":\"edplus_anim-zOPVId\"} -->\n<p class=\"eplus-lIZWW6 edplus_anim-zOPVId has-white-color has-text-color\">Your site is launched and you receive a full marketing plan including content, keyword research, long tail keywords, social strategy, SEO, paid search, email marketing and whatever else your business needs to succeed. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"className\":\"eplus-OCpTQk\",\"epGeneratedClass\":\"eplus-OCpTQk\",\"epAnimationGeneratedClass\":\"edplus_anim-VEos9t\"} -->\n<p class=\"eplus-OCpTQk\"></p>\n<!-- /wp:paragraph --></div></div></div>\n<!-- /wp:genesis-blocks/gb-container -->\n\n<!-- wp:paragraph {\"className\":\"eplus-W0lMXv\",\"epGeneratedClass\":\"eplus-W0lMXv\",\"epAnimationGeneratedClass\":\"edplus_anim-YACkkh\"} -->\n<p class=\"eplus-W0lMXv\"> </p>\n<!-- /wp:paragraph --></div></div></div>\n<!-- /wp:genesis-blocks/gb-container -->\n\n<!-- wp:paragraph {\"className\":\"eplus-Gx0RWX\",\"epGeneratedClass\":\"eplus-Gx0RWX\",\"epAnimationGeneratedClass\":\"edplus_anim-aZlARz\"} -->\n<p class=\"eplus-Gx0RWX\"></p>\n<!-- /wp:paragraph -->','About-us','','publish','closed','closed','','about-us-2','','','2020-11-23 21:45:40','2020-11-23 21:45:40','',0,'https://alphaomegadigital.com.au/?page_id=9069',0,'page','',0),(9098,1,'2020-11-23 04:39:33','2020-11-23 04:39:33',' ','','','publish','closed','closed','','9098','','','2020-11-25 05:06:18','2020-11-25 05:06:18','',0,'https://alphaomegadigital.com.au/?p=9098',2,'nav_menu_item','',0),(9109,1,'2020-11-23 04:56:45','2020-11-23 04:56:45',' ','','','publish','closed','closed','','9109','','','2020-11-25 05:06:18','2020-11-25 05:06:18','',0,'https://alphaomegadigital.com.au/?p=9109',6,'nav_menu_item','',0),(9113,1,'2020-11-23 05:17:51','2020-11-23 05:17:51',' ','','','publish','closed','closed','','9113','','','2020-11-25 05:06:18','2020-11-25 05:06:18','',0,'https://alphaomegadigital.com.au/?p=9113',7,'nav_menu_item','',0),(9171,1,'2020-11-25 01:51:32','2020-11-25 01:51:32','<!-- wp:heading -->\n<h2 id=\"block-bf218a20-fb52-4fb3-9ca4-75e8913e22ed\"><br>Who we are</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p id=\"block-203710c9-a092-416f-9820-65bdf485ce9a\">Our website address is: https://alphadevsite.co.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 id=\"block-5b65f4ef-7c5d-402a-8553-c53a622d18c7\">What personal data we collect and why we collect it</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3 id=\"block-75389fe3-807f-46c5-9662-1309bdeb9254\">Comments</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p id=\"block-15510e1b-214d-4851-aec4-1cef533df6ec\">When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor’s IP address and browser user agent string to help spam detection.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p id=\"block-661b05f0-49b3-4e74-85a5-daacad673f63\">An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3 id=\"block-54d44463-9840-4df7-9366-4f92c1d80a10\">Media</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p id=\"block-518de593-68f9-4252-a59d-bc3a636e7de8\">If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3 id=\"block-b8267844-48fa-48c4-af32-7b219bafec16\">Contact forms</h3>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3 id=\"block-8b33b80e-1992-40c5-9910-048d015834aa\">Cookies</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p id=\"block-381a2674-e494-4d7d-ac04-96e7acc953d1\">If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p id=\"block-309dfac4-e5ef-45eb-a4d3-140dd7af12cf\">If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p id=\"block-cf755cb1-8371-4f32-91de-c5199ca18bd6\">When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select \"Remember Me\", your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p id=\"block-556c4fd4-ceab-464e-b7dc-7f73f48bf3ed\">If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3 id=\"block-b41965f8-d44b-4860-a786-50a14c6ffb02\">Embedded content from other websites</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p id=\"block-8fb30453-9b16-4eac-8a26-efc18c43e842\">Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p id=\"block-2c6d30d3-cfef-464d-84d3-a12c434ffcf7\">These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3 id=\"block-2561f45d-9815-463a-91b6-0ff47da3b4dd\">Analytics</h3>\n<!-- /wp:heading -->\n\n<!-- wp:heading -->\n<h2 id=\"block-c63272c0-88ef-4f75-ac3d-6fe6cd5f1345\">Who we share your data with</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading -->\n<h2 id=\"block-7b53d09f-30ed-420d-9e08-1c6eaa71d694\">How long we retain your data</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p id=\"block-a5db2a03-1334-45e8-ab32-7ef471dbbc68\">If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p id=\"block-c8415e61-8a91-4515-a4fe-1e487e026f79\">For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 id=\"block-177bf836-a534-4734-8684-478f87c423f4\">What rights you have over your data</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p id=\"block-c305d4e7-4daa-4638-a145-0daf80c5b27c\">If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 id=\"block-4f679e50-f00b-4c02-be38-437b6c8c53d7\">Where we send your data</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p id=\"block-e823a9cf-c41e-4c68-89b4-bf4cd3e3d63e\">Visitor comments may be checked through an automated spam detection service.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 id=\"block-c26c0155-e9e1-4fd7-b16e-1ef7114a16b9\">Your contact information</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading -->\n<h2 id=\"block-a75d7ebc-bc02-49d3-8174-b229c5c65757\">Additional information</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3 id=\"block-1f3c5923-993c-4eea-b01e-b1a995c522db\">How we protect your data</h3>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3 id=\"block-1c00c7a0-b275-4d07-a931-5af90ef42927\">What data breach procedures we have in place</h3>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3 id=\"block-32adbb73-8235-4ceb-ae5e-3cbbca39ec60\">What third parties we receive data from</h3>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3 id=\"block-c35d22fe-795e-47cb-9c7b-6c8512499240\">What automated decision making and/or profiling we do with user data</h3>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3 id=\"block-574afe27-06ae-4260-b3d2-1e900e485092\">Industry regulatory disclosure requirements</h3>\n<!-- /wp:heading -->','PP','','trash','closed','closed','','__trashed','','','2020-11-25 01:51:32','2020-11-25 01:51:32','',0,'https://alphaomegadigital.com.au/?page_id=9171',0,'page','',0),(9172,1,'2020-11-25 01:37:11','2020-11-25 01:37:11','<!-- wp:heading -->\n<h2 id=\"block-bf218a20-fb52-4fb3-9ca4-75e8913e22ed\"><br>Who we are</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p id=\"block-203710c9-a092-416f-9820-65bdf485ce9a\">Our website address is: https://alphadevsite.co.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 id=\"block-5b65f4ef-7c5d-402a-8553-c53a622d18c7\">What personal data we collect and why we collect it</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3 id=\"block-75389fe3-807f-46c5-9662-1309bdeb9254\">Comments</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p id=\"block-15510e1b-214d-4851-aec4-1cef533df6ec\">When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor’s IP address and browser user agent string to help spam detection.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p id=\"block-661b05f0-49b3-4e74-85a5-daacad673f63\">An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3 id=\"block-54d44463-9840-4df7-9366-4f92c1d80a10\">Media</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p id=\"block-518de593-68f9-4252-a59d-bc3a636e7de8\">If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3 id=\"block-b8267844-48fa-48c4-af32-7b219bafec16\">Contact forms</h3>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3 id=\"block-8b33b80e-1992-40c5-9910-048d015834aa\">Cookies</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p id=\"block-381a2674-e494-4d7d-ac04-96e7acc953d1\">If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p id=\"block-309dfac4-e5ef-45eb-a4d3-140dd7af12cf\">If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p id=\"block-cf755cb1-8371-4f32-91de-c5199ca18bd6\">When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select \"Remember Me\", your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p id=\"block-556c4fd4-ceab-464e-b7dc-7f73f48bf3ed\">If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3 id=\"block-b41965f8-d44b-4860-a786-50a14c6ffb02\">Embedded content from other websites</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p id=\"block-8fb30453-9b16-4eac-8a26-efc18c43e842\">Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p id=\"block-2c6d30d3-cfef-464d-84d3-a12c434ffcf7\">These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3 id=\"block-2561f45d-9815-463a-91b6-0ff47da3b4dd\">Analytics</h3>\n<!-- /wp:heading -->\n\n<!-- wp:heading -->\n<h2 id=\"block-c63272c0-88ef-4f75-ac3d-6fe6cd5f1345\">Who we share your data with</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading -->\n<h2 id=\"block-7b53d09f-30ed-420d-9e08-1c6eaa71d694\">How long we retain your data</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p id=\"block-a5db2a03-1334-45e8-ab32-7ef471dbbc68\">If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p id=\"block-c8415e61-8a91-4515-a4fe-1e487e026f79\">For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 id=\"block-177bf836-a534-4734-8684-478f87c423f4\">What rights you have over your data</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p id=\"block-c305d4e7-4daa-4638-a145-0daf80c5b27c\">If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 id=\"block-4f679e50-f00b-4c02-be38-437b6c8c53d7\">Where we send your data</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p id=\"block-e823a9cf-c41e-4c68-89b4-bf4cd3e3d63e\">Visitor comments may be checked through an automated spam detection service.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 id=\"block-c26c0155-e9e1-4fd7-b16e-1ef7114a16b9\">Your contact information</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading -->\n<h2 id=\"block-a75d7ebc-bc02-49d3-8174-b229c5c65757\">Additional information</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3 id=\"block-1f3c5923-993c-4eea-b01e-b1a995c522db\">How we protect your data</h3>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3 id=\"block-1c00c7a0-b275-4d07-a931-5af90ef42927\">What data breach procedures we have in place</h3>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3 id=\"block-32adbb73-8235-4ceb-ae5e-3cbbca39ec60\">What third parties we receive data from</h3>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3 id=\"block-c35d22fe-795e-47cb-9c7b-6c8512499240\">What automated decision making and/or profiling we do with user data</h3>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3 id=\"block-574afe27-06ae-4260-b3d2-1e900e485092\">Industry regulatory disclosure requirements</h3>\n<!-- /wp:heading -->','PP','','inherit','closed','closed','','9171-revision-v1','','','2020-11-25 01:37:11','2020-11-25 01:37:11','',9171,'https://alphaomegadigital.com.au/9171-revision-v1/',0,'revision','',0),(9173,1,'2020-11-25 01:51:08','2020-11-25 01:51:08','<!-- wp:cover {\"url\":\"https://alphaomegadigital.com.au/wp-content/uploads/2017/07/studio-1.jpg\",\"id\":7294,\"hasParallax\":true,\"dimRatio\":93,\"minHeight\":800,\"gradient\":\"vivid-cyan-blue-to-vivid-purple\",\"align\":\"full\",\"className\":\"eplus-vKu94p\"} -->\n<div class=\"wp-block-cover alignfull has-background-dim-90 has-background-dim has-parallax has-background-gradient eplus-vKu94p\" style=\"background-image:url(https://alphaomegadigital.com.au/wp-content/uploads/2017/07/studio-1.jpg);min-height:800px\"><span aria-hidden=\"true\" class=\"wp-block-cover__gradient-background has-vivid-cyan-blue-to-vivid-purple-gradient-background\"></span><div class=\"wp-block-cover__inner-container\"><!-- wp:paragraph {\"align\":\"left\",\"placeholder\":\"Write title…\",\"className\":\"fade-in-up in viewport eplus-BvaxW7\",\"style\":{\"typography\":{\"fontSize\":58}}} -->\n<p class=\"has-text-align-left fade-in-up in viewport eplus-BvaxW7\" id=\"h1-hero\" style=\"font-size:58px\"><strong>Privacy Policy</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns {\"align\":\"full\",\"class