l\",\"buttonShape\":\"gb-button-shape-circular\"} -->\n<div style=\"text-align:center\" class=\"wp-block-genesis-blocks-gb-button gb-block-button\"><a href=\"https://alphaomegadigital.com.au/content-marketing-2/\" class=\"gb-button gb-button-shape-circular gb-button-size-small\" style=\"color:#ffffff;background-color:#3373dc\">learn more</a></div>\n<!-- /wp:genesis-blocks/gb-button --></div></div></div>\n<!-- /wp:genesis-blocks/gb-container --></div></div></div>\n<!-- /wp:genesis-blocks/gb-container --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div></div></div>\n<!-- /wp:genesis-blocks/gb-container --></div></div></div>\n<!-- /wp:genesis-blocks/gb-container -->\n\n<!-- wp:genesis-blocks/gb-container {\"containerPaddingTop\":0,\"containerPaddingRight\":0,\"containerPaddingBottom\":0,\"containerPaddingLeft\":0,\"containerMarginTop\":0,\"containerMarginBottom\":0,\"containerBackgroundColor\":\"#443d94\",\"containerDimRatio\":10,\"align\":\"full\"} -->\n<div style=\"background-color:#443d94\" class=\"wp-block-genesis-blocks-gb-container alignfull gb-block-container\"><div class=\"gb-container-inside\"><div class=\"gb-container-content\"><!-- wp:genesis-blocks/gb-container {\"containerPaddingTop\":5,\"containerPaddingRight\":10,\"containerPaddingBottom\":10,\"containerPaddingLeft\":10} -->\n<div style=\"padding-left:10%;padding-right:10%;padding-bottom:10%;padding-top:5%\" class=\"wp-block-genesis-blocks-gb-container gb-block-container\"><div class=\"gb-container-inside\"><div class=\"gb-container-content\"><!-- wp:heading {\"textColor\":\"white\"} -->\n<h2 class=\"has-white-color has-text-color\" id=\"block-bf218a20-fb52-4fb3-9ca4-75e8913e22ed\"><br>Who we are</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\" id=\"block-203710c9-a092-416f-9820-65bdf485ce9a\">Our website address is: https://alphaomegadigital.com.au and we are a digital marketing agency based in Melbourne, Australia. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"textColor\":\"white\"} -->\n<h2 class=\"has-white-color has-text-color\" id=\"block-5b65f4ef-7c5d-402a-8553-c53a622d18c7\">What personal data we collect and why we collect it</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"textColor\":\"white\"} -->\n<h2 class=\"has-white-color has-text-color\" id=\"block-75389fe3-807f-46c5-9662-1309bdeb9254\">Comments</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\" id=\"block-15510e1b-214d-4851-aec4-1cef533df6ec\">When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor’s IP address and browser user agent string to help spam detection.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\" id=\"block-661b05f0-49b3-4e74-85a5-daacad673f63\">An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"textColor\":\"white\"} -->\n<h2 class=\"has-white-color has-text-color\" id=\"block-54d44463-9840-4df7-9366-4f92c1d80a10\">Media</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\" id=\"block-518de593-68f9-4252-a59d-bc3a636e7de8\">If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"textColor\":\"white\"} -->\n<h2 class=\"has-white-color has-text-color\" id=\"block-b8267844-48fa-48c4-af32-7b219bafec16\">Contact forms</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">all enquiries to contact forms, mailing lists, and opt ins automatically subscribe you to our email marketing platform. There are options at the bottom of the email to unsubscribe anytime. Even if you opt out your record is saved as a previous subscriber who is now unsubscribed. If you would like your record permanently deleted please request it. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"textColor\":\"white\"} -->\n<h2 class=\"has-white-color has-text-color\" id=\"block-8b33b80e-1992-40c5-9910-048d015834aa\">Cookies</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\" id=\"block-381a2674-e494-4d7d-ac04-96e7acc953d1\">If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\" id=\"block-309dfac4-e5ef-45eb-a4d3-140dd7af12cf\">If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\" id=\"block-cf755cb1-8371-4f32-91de-c5199ca18bd6\">When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select \"Remember Me\", your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\" id=\"block-556c4fd4-ceab-464e-b7dc-7f73f48bf3ed\">If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"textColor\":\"white\"} -->\n<h2 class=\"has-white-color has-text-color\" id=\"block-b41965f8-d44b-4860-a786-50a14c6ffb02\">Embedded content from other websites</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\" id=\"block-8fb30453-9b16-4eac-8a26-efc18c43e842\">Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\" id=\"block-2c6d30d3-cfef-464d-84d3-a12c434ffcf7\">These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"textColor\":\"white\"} -->\n<h2 class=\"has-white-color has-text-color\" id=\"block-2561f45d-9815-463a-91b6-0ff47da3b4dd\">Analytics</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">Records of your page visits, time spent on page, logins, opt ins, and any other activity on this site are recorded for analytics purposes and stored in both Databox and google analytics. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"textColor\":\"white\"} -->\n<h2 class=\"has-white-color has-text-color\" id=\"block-c63272c0-88ef-4f75-ac3d-6fe6cd5f1345\">Who we share your data with</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">Your usage and contact information is shared with third party apps such as Google Analytics, Databox, Mailchimp, campaign monitor, Hootsuite and any other email or marketing platforms we choose to engage. Alpha and Omega digital is not responsible for the way third party apps handle your data, or for any data breaches that may result from the data transfer process. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"textColor\":\"white\"} -->\n<h2 class=\"has-white-color has-text-color\" id=\"block-7b53d09f-30ed-420d-9e08-1c6eaa71d694\">How long we retain your data</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\" id=\"block-a5db2a03-1334-45e8-ab32-7ef471dbbc68\">If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognise and approve any follow-up comments automatically instead of holding them in a moderation queue.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\" id=\"block-c8415e61-8a91-4515-a4fe-1e487e026f79\">For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"textColor\":\"white\"} -->\n<h2 class=\"has-white-color has-text-color\" id=\"block-177bf836-a534-4734-8684-478f87c423f4\">What rights you have over your data</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\" id=\"block-c305d4e7-4daa-4638-a145-0daf80c5b27c\">If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"textColor\":\"white\"} -->\n<h2 class=\"has-white-color has-text-color\" id=\"block-4f679e50-f00b-4c02-be38-437b6c8c53d7\">Where we send your data</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\" id=\"block-e823a9cf-c41e-4c68-89b4-bf4cd3e3d63e\">Visitor comments may be checked through an automated spam detection service.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"className\":\"eplus-j6u9kJ edplus_anim-sG08BE\",\"textColor\":\"white\",\"style\":{\"typography\":{\"fontSize\":30}}} -->\n<h2 class=\"eplus-j6u9kJ edplus_anim-sG08BE has-white-color has-text-color\" style=\"font-size:30px\"></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"className\":\"eplus-L0uSie\"} -->\n<p class=\"eplus-L0uSie\"></p>\n<!-- /wp:paragraph --></div></div></div>\n<!-- /wp:genesis-blocks/gb-container -->\n\n<!-- wp:paragraph {\"className\":\"eplus-W0lMXv\"} -->\n<p class=\"eplus-W0lMXv\"> </p>\n<!-- /wp:paragraph --></div></div></div>\n<!-- /wp:genesis-blocks/gb-container -->\n\n<!-- wp:paragraph {\"className\":\"eplus-Gx0RWX\"} -->\n<p class=\"eplus-Gx0RWX\"></p>\n<!-- /wp:paragraph -->','Privacy Policy','','inherit','closed','closed','','9170-revision-v1','','','2020-11-25 01:51:08','2020-11-25 01:51:08','',9170,'https://alphaomegadigital.com.au/9170-revision-v1/',0,'revision','',0),(9174,1,'2020-11-25 01:51:50','2020-11-25 01:51:50',' ','','','publish','closed','closed','','9174','','','2020-11-25 05:06:18','2020-11-25 05:06:18','',0,'https://alphaomegadigital.com.au/?