></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">a.If a Force Majeure event causing delay continues for more than 30 days, we may terminate this Agreement by giving at least 30 days Notice to you.  “Force Majeure” means any act, circumstance or omission over which we could not reasonably have exercised control. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"textColor\":\"white\"} -->\n<h2 class=\"has-white-color has-text-color\"><strong>Jurisdiction</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">a.These terms and conditions are to be governed by and construed in accordance with the laws of VIC and any claim made by either party against the other which in any way arises out of these terms and conditions will be heard in VIC and you agree to submit to the jurisdiction of those Courts.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">b.If any provision in these terms and conditions is invalid under any law the provision will be limited, narrowed, construed or altered as necessary to render it valid but only to the extent necessary to achieve such validity.  If necessary the invalid provision will be deleted from these terms and conditions and the remaining provisions will remain in full force and effect.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"textColor\":\"white\"} -->\n<h2 class=\"has-white-color has-text-color\"><strong>Privacy&nbsp;</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">a.We undertake to take all due care with any information which you may provide to us when accessing our website. However we do not warrant and cannot ensure the security of any information which you may provide to us.  Information you transmit to us is entirely 