-blocks-gb-container gb-block-container\"><div class=\"gb-container-inside\"><div class=\"gb-container-content\"><!-- wp:heading {\"textColor\":\"white\"} -->\n<h2 class=\"has-white-color has-text-color\"><strong>WEBSITE TERMS AND CONDITIONS</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">In these terms and conditions, “we” “us” and “our” refers to Alpha Omega Digital Pty ltd.&nbsp; Your access to and use of all information on this website including purchase of our product/s is provided subject to the following terms and conditions. &nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">We reserve the right to amend this Notice at any time and your use of the website following any amendments will represent your agreement to be bound by these terms and conditions as amended.&nbsp; We therefore recommend that each time you access our website you read these terms and conditions.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"textColor\":\"white\"} -->\n<h2 class=\"has-white-color has-text-color\"><strong>Members</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">1.In order to access the services provided on this website, you must become a member. You must complete registration by providing certain information as set out on our membership/registration page.  Please refer to our Privacy Policy linked on our home page for information relating to our collection, storage and use of the details you provide on registration.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">2.You agree to ensure that your registration details are true and accurate at all times and you undertake to update your registration details from time to time when they change.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">3.On registration, we provide you with a password. On registration you agree to pay for our services as set out on our website.  </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">4.We reserve the right to terminate your membership at any time if you breach these terms and conditions.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"textColor\":\"white\"} -->\n<h2 class=\"has-white-color has-text-color\"><strong>Our Website Services</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">1.Our services are provided to adults over the age of eighteen (18) years.  By proceeding to purchase through our website, you acknowledge that you are over 18 years of age.<strong> </strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">2.All prices are in Australian Dollars (AUD) and are exclusive of GST.  We endeavour to ensure that our price list is current.  Our price list can be accessed from our home page and we reserve the right to amend our prices at any time.  If you have placed an order, we reserve the right to cancel your order should our prices change. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"textColor\":\"white\"} -->\n<h2 class=\"has-white-color has-text-color\"><strong>Product Descriptions</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">1.We strive to ensure that our products are described as accurately as possible on our website, however we do not warrant that the description is accurate.  Where we become aware of any misdescription, we reserve the right to correct any error or omission.  </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"te