or malware.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">6.We undertake to accept or reject your order within 7 days days.  If we have not responded to you within 7 days days, your offer is deemed to be rejected.  We are not required to give reasons for rejecting your offer to purchase however the most likely reason for rejecting your offer will be that we do not currently have that product in stock.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">7.Once you have submitted an order, you may not cancel that order even if our acceptance or rejection of your offer is still pending.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">8.Delivery of your ordered product/s will be as set out on our website.  Title in the goods passes to you when we have received payment.  Our terms of payment are set out on the order page.  </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">9.All risk of loss or damage to the goods passes to you when we despatch the goods. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"textColor\":\"white\"} -->\n<h2 class=\"has-white-color has-text-color\"><strong>Product Returns</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">1.We undertake to reimburse you for any product delivered to you that is faulty or is in a damaged condition.  If you wish to return a faulty or damaged product, you must notify us through our designated “contact us” webpage where we set out our requirements relating to return of such goods. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">2.If we are unable at the time of ret