ther traders.  Responsibility for the content of such material rests with the owners of that material and we are not responsible for any errors or omissions in such material. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"textColor\":\"white\"} -->\n<h2 class=\"has-white-color has-text-color\"><strong>Statutory Guarantees and Warranties to Consumers&nbsp;</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">1.Schedule 2 of the Competition and Consumer Act 2010 (<strong>“C&amp;C Act”</strong>) defines a consumer.  Under the C&amp;C Act we are a supplier of either goods or services or both to you, and as a consumer the C&amp;C Act gives you statutory guarantees.  Attached to the Standard Terms and Conditions are:-</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">a.Schedule 2 of the C&amp;C Act; and</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">b.those statutory guarantees, all of which are given by us to you if you are a consumer.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">a.If you are a consumer within the meaning of Schedule 2 of the C&amp;C Act of our goods or services then we give you a warranty that at the time of supply of those goods or services to you, if they are defective then:-</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">i.We will repair or replace the goods or any part of them that is defective; or</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">ii.Provide again or rectify any services or part of them that are defective; or</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">iii.Wholly or partly recompense you if they are defective.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">a.As a consumer under the C&amp;C Act you may be entitled to receive from us notices under Schedule 2 section 103 of the C&amp;C Act.  In that regard:-</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">i.If you are a consumer within the meaning of Schedule 2 of the C&amp;C Act and the goods or services we are providing relate to the repair of consumer goods then we will give you any notice which we are obliged to give you under Schedule 2 section 103 of the C&amp;C Act.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">ii.If we are a repairer of goods capable of retaining user-generated data then we hereby give you notice that the repair of those goods may result in the loss of the data.  </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">iii.If we are a repairer and our practice is to supply refurbished goods as an alternative to repairing your defective goods or to use refurbished parts in the repair, then we give you notice that the goods presented by you to us for repair may be replaced by refurbished goods of the same type rather than being repaired.  We also give you notice that we may use in the repair of your goods, refurbished parts.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"textColor\":\"white\"} -->\n<h2 class=\"has-white-color has-text-color\"><strong>Limitation of Liability</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">a.If you are not a consumer within the meaning of Schedule 2 of the C&amp;C Act then this clause applies to you.  If you are a consumer within the meaning of the C&amp;C Act then this clause has no effect whatsoever to in any way limit our liability or your rights.  If you are not a consumer:- </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">i.To the full extent permitted by law, our liability for breach of an implied warranty or condition is limited to the supply of the services again or payment of the costs of having those services supplied again. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">ii.We accept no liability for any loss whatsoever including consequential loss suffered by you arising from services we have supplied. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">iii.We do not accept liability for anything contained in the post of a user or in any form of communication which originates with a user and not with Us.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">iv.We do not participate in any way in the transactions between our users.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"textColor\":\"white\"} -->\n<h2 class=\"has-white-color has-text-color\"><strong>Indemnity</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p class=\"has-white-color has-text-color\">a.By accessing our website, you agree to indemnify and hold us harmless from all claims, actions, damages, costs and expenses including legal fees arising from or in connection with your use of our website.  </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"textColor\":\"white\"} -->\n<h2 class=\"has-white-color has-text-color\"><strong>Force Majeure</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"textColor\":\"white\"} -->\n<p clas